(55, 'marketing_service.element', '{\"has_image\":[\"1\"],\"title\":\"Website design and development\",\"title_ar\":\"\\u062a\\u0635\\u0645\\u064a\\u0645 \\u0648\\u062a\\u0637\\u0648\\u064a\\u0631 \\u0627\\u0644\\u0645\\u0648\\u0642\\u0639\",\"description\":\"<font color=\\\"#6c757d\\\" face=\\\"Inter, sans-serif\\\"><span style=\\\"letter-spacing:normal;\\\">Designing and hosting websites is one of the most important means for companies to excel in all commercial and non-commercial activities. Whereas, having a website with a creative design and high speed is a success and superiority over competitors in the same field.<\\/span><\\/font><br \\/>\",\"description_ar\":\"\\u064a\\u0639\\u062f \\u062a\\u0635\\u0645\\u064a\\u0645 \\u0648\\u0627\\u0633\\u062a\\u0636\\u0627\\u0641\\u0629 \\u0627\\u0644\\u0645\\u0648\\u0627\\u0642\\u0639 \\u0627\\u0644\\u0625\\u0644\\u0643\\u062a\\u0631\\u0648\\u0646\\u064a\\u0629 \\u0645\\u0646 \\u0623\\u0647\\u0645 \\u0627\\u0644\\u0648\\u0633\\u0627\\u0626\\u0644 \\u0627\\u0644\\u062a\\u064a \\u062a\\u0633\\u0627\\u0639\\u062f \\u0627\\u0644\\u0634\\u0631\\u0643\\u0627\\u062a \\u0639\\u0644\\u0649 \\u0627\\u0644\\u062a\\u0645\\u064a\\u0632 \\u0641\\u064a \\u062c\\u0645\\u064a\\u0639 \\u0627\\u0644\\u0623\\u0646\\u0634\\u0637\\u0629 \\u0627\\u0644\\u062a\\u062c\\u0627\\u0631\\u064a\\u0629 \\u0648\\u063a\\u064a\\u0631 \\u0627\\u0644\\u062a\\u062c\\u0627\\u0631\\u064a\\u0629. \\u062d\\u064a\\u062b \\u0623\\u0646 \\u0627\\u0645\\u062a\\u0644\\u0627\\u0643 \\u0645\\u0648\\u0642\\u0639 \\u0625\\u0644\\u0643\\u062a\\u0631\\u0648\\u0646\\u064a \\u0630\\u0648 \\u062a\\u0635\\u0645\\u064a\\u0645 \\u0625\\u0628\\u062f\\u0627\\u0639\\u064a \\u0648\\u0633\\u0631\\u0639\\u0629 \\u0639\\u0627\\u0644\\u064a\\u0629 \\u064a\\u0639\\u062f \\u0646\\u062c\\u0627\\u062d\\u0627\\u064b \\u0648\\u062a\\u0641\\u0648\\u0642\\u0627\\u064b \\u0639\\u0644\\u0649 \\u0627\\u0644\\u0645\\u0646\\u0627\\u0641\\u0633\\u064a\\u0646 \\u0641\\u064a \\u0646\\u0641\\u0633 \\u0