(56, 'marketing_service.element', '{\"has_image\":[\"1\"],\"title\":\"Optimizing websites for search engines\",\"title_ar\":\"\\u062a\\u062d\\u0633\\u064a\\u0646 \\u0645\\u0648\\u0627\\u0642\\u0639 \\u0627\\u0644\\u0648\\u064a\\u0628 \\u0644\\u0645\\u062d\\u0631\\u0643\\u0627\\u062a \\u0627\\u0644\\u0628\\u062d\\u062b\",\"description\":\"<span style=\\\"color:rgb(108,117,125);font-family:Inter, sans-serif;letter-spacing:normal;\\\">We help you to get many visits to your website, the results of private search engines are at the forefront by investing in site preparation services for search engines, or what is called SEO<\\/span><br \\/>\",\"description_ar\":\"\\u0646\\u0633\\u0627\\u0639\\u062f\\u0643 \\u0641\\u064a \\u0627\\u0644\\u062d\\u0635\\u0648\\u0644 \\u0639\\u0644\\u0649 \\u0632\\u064a\\u0627\\u0631\\u0627\\u062a \\u0639\\u062f\\u064a\\u062f\\u0629 \\u0644\\u0645\\u0648\\u0642\\u0639\\u0643 \\u0627\\u0644\\u0625\\u0644\\u0643\\u062a\\u0631\\u0648\\u0646\\u064a\\u060c \\u0646\\u062a\\u0627\\u0626\\u062c \\u0645\\u062d\\u0631\\u0643\\u0627\\u062a \\u0627\\u0644\\u0628\\u062d\\u062b \\u0627\\u0644\\u062e\\u0627\\u0635\\u0629 \\u0641\\u064a \\u0627\\u0644\\u0645\\u0642\\u062f\\u0645\\u0629 \\u0645\\u0646 \\u062e\\u0644\\u0627\\u0644 \\u0627\\u0644\\u0627\\u0633\\u062a\\u062b\\u0645\\u0627\\u0631 \\u0641\\u064a \\u062e\\u062f\\u0645\\u0627\\u062a \\u0625\\u0639\\u062f\\u0627\\u062f \\u0627\\u0644\\u0645\\u0648\\u0642\\u0639 \\u0644\\u0645\\u062d\\u0631\\u0643\\u0627\\u062a \\u0627\\u0644\\u0628\\u062d\\u062b \\u0623\\u0648 \\u0645\\u0627 \\u064a\\u0633\\u0645\\u0649 SEO<br \\/>\",\"service_request_url\":\"marketing-request\",\"image\":\"65bef26b9c4e71707012715.png\"}', 'basic', '2024-02-03 20:11:55', '2024-02-05 21:23:26'),
(57, 'marketing_service.element', '{\"has_image\":[\"1\"],\"title\":\"Managing social networking pages\",\"title_ar\":\"\\u0625\\u062f\\u0627\\u0631\\u0629 \\u0635\\u0641\\u062d\\u0627\\u062a \\u0627\\u0644\\u062a\\u0648\\u0627\\u0635\\u0644 \\u0627\\u0644\\u0627\\u062c\\u062a\\u0645\\u0627\\u0639\\u064a\",\"description\":\"Social media channels are very competitive platforms, and in order to establish your business presence on these electronic platforms that your audience has chosen to be present on, you must adopt a professional marketing plan that attracts the interest of your audience.<br \\/>\",\"description_ar\":\"\\u062a\\u0639\\u062a\\u0628\\u0631 \\u0642\\u0646\\u0648\\u0627\\u062a \\u0627\\u0644\\u062a\\u0648\\u0627\\u0635\\u0644 \\u0627\\u0644\\u0627\\u062c\\u062a\\u0645\\u0627\\u0639\\u064a \\u0645\\u0646\\u0635\\u0627\\u062a \\u062a\\u0646\\u0627\\u0641\\u0633\\u064a\\u0629 \\u0644\\u0644\\u063a\\u0627\\u064a\\u0629\\u060c \\u0648\\u0644\\u0643\\u064a \\u062a\\u062b\\u0628\\u062a \\u062a\\u0648\\u0627\\u062c\\u062f \\u0623\\u0639\\u0645\\u0627\\u0644\\u0643 \\u0639\\u0644\\u0649 \\u0647\\u0630\\u0647 \\u0627\\u0644\\u0645\\u0646\\u0635\\u0627\\u062a \\u0627\\u0644\\u0625\\u0644\\u0643\\u062a\\u0631\\u0648\\u0646\\u064a\\u0629 \\u0627\\u0644\\u062a\\u064a \\u0627\\u062e\\u062a\\u0627\\u0631 \\u062c\\u0645\\u0647\\u0648\\u0631\\u0643 \\u0627\\u0644\\u062a\\u0648\\u0627\\u062c\\u062f \\u0639\\u0644\\u064a\\u0647\\u0627\\u060c \\u0639\\u0644\\u064a\\u0643 \\u0623\\u0646 \\u062a\\u0639\\u062a\\u0645\\u062f \\u062e\\u0637\\u0629 \\u062a\\u0633\\u0648\\u064a\\u0642\\u064a\\u0629 \\u0627\\u062d\\u062a\\u0631\\u0627\\u0641\\u064a\\u0629 \\u062a\\u062c\\u0630\\u0628 \\u0627\\u0647\\u062a\\u0645\\u0627\\u0645 \\u062c\\u0645\\u0647\\u0648\\u0631\\u0643.<br \\/>\",\"service_request_url\":\"marketing-request\",\"image\":\"65bef28ad5baf1707012746.png\"}', 'basic', '2024-02-03 20:12:26', '2024-02-05 21:23:36'),
(58, 'add_property.content', '{\"has_image\":\"1\",\"title\":\"Do you have a property to sell or rent?\",\"title_ar\":\"\\u0647\\u0644 \\u0644\\u062f\\u064a\\u0643 \\u0639\\u0642\\u0627\\u0631 \\u0644\\u0644\\u0628\\u064a\\u0639 \\u0623\\u0648 \\u0627\\u0644\\u0625\\u064a\\u062c\\u0627\\u0631\\u061f\",\"description\":\"Anytime, you can advertise your property on our portal for buy, sale and auction, or you can authorize our specialized Agents to auction or sell it for quickly.\",\"description_ar\":\"\\u0641\\u064a \\u0623\\u064a \\u0648\\u0642\\u062a\\u060c \\u064a\\u0645\\u0643\\u0646\\u0643 \\u0627\\u0644\\u0625\\u0639\\u0644\\u0627\\u0646 \\u0639\\u0646 \\u0645\\u0645\\u062a\\u0644\\u0643\\u0627\\u062a\\u0643 \\u0639\\u0644\\u0649 \\u0628\\u0648\\u0627\\u0628\\u062a\\u0646\\u0627 \\u0644\\u0644\\u0634\\u0631\\u0627\\u0621 \\u0648\\u0627\\u0644\\u0628\\u064a\\u0639 \\u0648\\u0627\\u0644\\u0645\\u0632\\u0627\\u062f \\u0627\\u0644\\u0639\\u0644\\u0646\\u064a\\u060c \\u0623\\u0648 \\u064a\\u0645\\u0643\\u0646\\u0643 \\u062a\\u0641\\u0648\\u064a\\u0636 \\u0648\\u0643\\u0644\\u0627\\u0626\\u0646\\u0627 \\u0627\\u0644\\u0645\\u062a\\u062e\\u0635\\u0635\\u064a\\u0646 \\u0628\\u0627\\u0644\\u0645\\u0632\\u0627\\u062f \\u0627\\u0644\\u0639\\u0644\\u0646\\u064a \\u0623\\u0648 \\u0628\\u064a\\u0639\\u0647\\u0627 \\u0628\\u0633\\u0631\\u0639\\u0629.\",\"button_text\":\"Add Property\",\"button_text_ar\":\"\\u0623\\u0636\\u0641 \\u062e\\u0627\\u0635\\u064a\\u0629\",\"button_url\":\"user\\/properties\\/create\",\"image\":\"65c89576d6b071707644278.png\"}', 'basic', '2024-02-03 20:26:44', '2024-02-11 03:37:59'),
