(60, 'finance_service.content', '{\"has_image\":\"1\",\"title\":\"Real estate financing\",\"title_ar\":\"\\u0627\\u0644\\u062a\\u0645\\u0648\\u064a\\u0644 \\u0627\\u0644\\u0639\\u0642\\u0627\\u0631\\u064a\",\"description\":\"<p style=\\\"color:rgb(66,66,66);font-family:Inter, sans-serif;letter-spacing:normal;\\\">Amlaek contributes to granting real estate financing loans through partnership with many real estate financing companies in the Kingdom.<\\/p><p style=\\\"color:rgb(66,66,66);font-family:Inter, sans-serif;letter-spacing:normal;\\\">To request a real estate finance, fill out the form and we will contact you<\\/p>\",\"description_ar\":\"<div>\\u062a\\u0633\\u0627\\u0647\\u0645 \\u0623\\u0645\\u0644\\u0627\\u0643 \\u0641\\u064a \\u0645\\u0646\\u062d \\u0642\\u0631\\u0648\\u0636 \\u0627\\u0644\\u062a\\u0645\\u0648\\u064a\\u0644 \\u0627\\u0644\\u0639\\u0642\\u0627\\u0631\\u064a \\u0645\\u0646 \\u062e\\u0644\\u0627\\u0644 \\u0627\\u0644\\u0634\\u0631\\u0627\\u0643\\u0629 \\u0645\\u0639 \\u0627\\u0644\\u0639\\u062f\\u064a\\u062f \\u0645\\u0646 \\u0634\\u0631\\u0643\\u0627\\u062a \\u0627\\u0644\\u062a\\u0645\\u0648\\u064a\\u0644 \\u0627\\u0644\\u0639\\u0642\\u0627\\u0631\\u064a \\u0641\\u064a \\u0627\\u0644\\u0645\\u0645\\u0644\\u0643\\u0629.<\\/div><div><br \\/><\\/div><div>\\u0644\\u0637\\u0644\\u0628 \\u0627\\u0644\\u062a\\u0645\\u0648\\u064a\\u0644 \\u0627\\u0644\\u0639\\u0642\\u0627\\u0631\\u064a \\u0627\\u0645\\u0644\\u0623 \\u0627\\u0644\\u0646\\u0645\\u0648\\u0630\\u062c \\u0648\\u0633\\u0646\\u0642\\u0648\\u0645 \\u0628\\u0627\\u0644\\u062a\\u0648\\u0627\\u0635\\u0644 \\u0645\\u0639\\u0643<\\/div>\",\"service_request_url\":\"finance-request\",\"image\":\"65befd77995a21707015543.png\"}', 'basic', '2024-02-03 20:59:03', '2024-02-06 20:15:22'),
