(63, 'evaluation_service.element', '{\"has_image\":[\"1\"],\"title\":\"Studies\",\"title_ar\":\"\\u062f\\u0631\\u0627\\u0633\\u0627\\u062a\",\"description\":\"<span style=\\\"color:rgb(66,66,66);font-family:Inter, sans-serif;letter-spacing:normal;\\\">Property market is huge and has many needs, so an extensive market study is required before launching any project to know the needs and priorities of the segment that your company is addressing with this product.<\\/span><br \\/>\",\"description_ar\":\"\\u0633\\u0648\\u0642 \\u0627\\u0644\\u0639\\u0642\\u0627\\u0631\\u0627\\u062a \\u0636\\u062e\\u0645 \\u0648\\u0644\\u0647 \\u0627\\u062d\\u062a\\u064a\\u0627\\u062c\\u0627\\u062a \\u0643\\u062b\\u064a\\u0631\\u0629\\u060c \\u0644\\u0630\\u0644\\u0643 \\u0644\\u0627 \\u0628\\u062f \\u0645\\u0646 \\u062f\\u0631\\u0627\\u0633\\u0629 \\u0633\\u0648\\u0642\\u064a\\u0629 \\u0645\\u0648\\u0633\\u0639\\u0629 \\u0642\\u0628\\u0644 \\u0625\\u0637\\u0644\\u0627\\u0642 \\u0623\\u064a \\u0645\\u0634\\u0631\\u0648\\u0639 \\u0644\\u0645\\u0639\\u0631\\u0641\\u0629 \\u0627\\u062d\\u062a\\u064a\\u0627\\u062c\\u0627\\u062a \\u0648\\u0623\\u0648\\u0644\\u0648\\u064a\\u0627\\u062a \\u0627\\u0644\\u0634\\u0631\\u064a\\u062d\\u0629 \\u0627\\u0644\\u062a\\u064a \\u062a\\u0633\\u062a\\u0647\\u062f\\u0641\\u0647\\u0627 \\u0634\\u0631\\u0643\\u062a\\u0643 \\u0628\\u0647\\u0630\\u0627 \\u0627\\u0644\\u0645\\u0646\\u062a\\u062c.<br \\/>\",\"service_request_url\":\"service-request\",\"image\":\"65bf486cbf1d51707034732.png\"}', 'basic', '2024-02-04 02:18:52', '2024-02-05 20:57:53'),
