(105, 'evaluation_plan.element', '{\"has_image\":[\"1\"],\"title\":\"Economic feasibility study\",\"title_ar\":\"\\u062f\\u0631\\u0627\\u0633\\u0629 \\u0627\\u0644\\u062c\\u062f\\u0648\\u0649 \\u0627\\u0644\\u0627\\u0642\\u062a\\u0635\\u0627\\u062f\\u064a\\u0629\",\"description\":\"<span style=\\\"color:rgb(66,66,66);font-family:Inter, sans-serif;letter-spacing:normal;\\\">Specialized in preparing economic feasibility studies within the necessary professional international standards, including marketing, financial, technical, environmental and social aspects, which contribute and assist owners in attracting investors and partners or requesting financing, and submitting them to official authorities to obtain licenses and approvals.<\\/span><br \\/>\",\"description_ar\":\"\\u0645\\u062a\\u062e\\u0635\\u0635\\u0648\\u0646 \\u0641\\u064a \\u0625\\u0639\\u062f\\u0627\\u062f \\u062f\\u0631\\u0627\\u0633\\u0627\\u062a \\u0627\\u0644\\u062c\\u062f\\u0648\\u0649 \\u0627\\u0644\\u0627\\u0642\\u062a\\u0635\\u0627\\u062f\\u064a\\u0629 \\u0636\\u0645\\u0646 \\u0627\\u0644\\u0645\\u0639\\u0627\\u064a\\u064a\\u0631 \\u0627\\u0644\\u062f\\u0648\\u0644\\u064a\\u0629 \\u0627\\u0644\\u0645\\u0647\\u0646\\u064a\\u0629 \\u0627\\u0644\\u0644\\u0627\\u0632\\u0645\\u0629\\u060c \\u0628\\u0645\\u0627 \\u0641\\u064a \\u0630\\u0644\\u0643 \\u0627\\u0644\\u062c\\u0648\\u0627\\u0646\\u0628 \\u0627\\u0644\\u062a\\u0633\\u0648\\u064a\\u0642\\u064a\\u0629 \\u0648\\u0627\\u0644\\u0645\\u0627\\u0644\\u064a\\u0629 \\u0648\\u0627\\u0644\\u0641\\u0646\\u064a\\u0629 \\u0648\\u0627\\u0644\\u0628\\u064a\\u0626\\u064a\\u0629 \\u0648\\u0627\\u0644\\u0627\\u062c\\u062a\\u0645\\u0627\\u0639\\u064a\\u0629\\u060c \\u0648\\u0627\\u0644\\u062a\\u064a \\u062a\\u0633\\u0627\\u0647\\u0645 \\u0648\\u062a\\u0633\\u0627\\u0639\\u062f \\u0627\\u0644\\u0645\\u0644\\u0627\\u0643 \\u0641\\u064a \\u062c\\u0630\\u0628 \\u0627\\u0644\\u0645\\u0633\\u062a\\u062b\\u0645\\u0631\\u064a\\u0646 \\u0648\\u0627\\u0644\\u0634\\u0631\\