(106, 'evaluation_plan.element', '{\"has_image\":[\"1\"],\"title\":\"Matchmaking of partners\",\"title_ar\":\"\\u0627\\u0644\\u062a\\u0648\\u0641\\u064a\\u0642 \\u0628\\u064a\\u0646 \\u0627\\u0644\\u0634\\u0631\\u0643\\u0627\\u0621\",\"description\":\"<span style=\\\"color:rgb(66,66,66);font-family:Inter, sans-serif;letter-spacing:normal;\\\">The property incubator contributes to reconciling partners, investors, real estate developers, certified accountants and investors in the sector and creating services that support the various stages of project establishment or marketing the project as a reliable partner<\\/span><br \\/>\",\"description_ar\":\"\\u062a\\u0633\\u0627\\u0647\\u0645 \\u0627\\u0644\\u062d\\u0627\\u0636\\u0646\\u0629 \\u0627\\u0644\\u0639\\u0642\\u0627\\u0631\\u064a\\u0629 \\u0641\\u064a \\u0627\\u0644\\u062a\\u0648\\u0641\\u064a\\u0642 \\u0628\\u064a\\u0646 \\u0627\\u0644\\u0634\\u0631\\u0643\\u0627\\u0621 \\u0648\\u0627\\u0644\\u0645\\u0633\\u062a\\u062b\\u0645\\u0631\\u064a\\u0646 \\u0648\\u0627\\u0644\\u0645\\u0637\\u0648\\u0631\\u064a\\u0646 \\u0627\\u0644\\u0639\\u0642\\u0627\\u0631\\u064a\\u064a\\u0646 \\u0648\\u0627\\u0644\\u0645\\u062d\\u0627\\u0633\\u0628\\u064a\\u0646 \\u0627\\u0644\\u0642\\u0627\\u0646\\u0648\\u0646\\u064a\\u064a\\u0646 \\u0648\\u0627\\u0644\\u0645\\u0633\\u062a\\u062b\\u0645\\u0631\\u064a\\u0646 \\u0641\\u064a \\u0627\\u0644\\u0642\\u0637\\u0627\\u0639 \\u0648\\u062e\\u0644\\u0642 \\u062e\\u062f\\u0645\\u0627\\u062a \\u062a\\u062f\\u0639\\u0645 \\u0627\\u0644\\u0645\\u0631\\u0627\\u062d\\u0644 \\u0627\\u0644\\u0645\\u062e\\u062a\\u0644\\u0641\\u0629 \\u0644\\u062a\\u0623\\u0633\\u064a\\u0633 \\u0627\\u0644\\u0645\\u0634\\u0631\\u0648\\u0639 \\u0623\\u0648 \\u062a\\u0633\\u0648\\u064a\\u0642 \\u0627\\u0644\\u0645\\u0634\\u0631\\u0648\\u0639 \\u0643\\u0634\\u0631\\u064a\\u0643 \\u0645\\u0648\\u062b\\u0648\\u0642 \\u0628\\u0647\",\"image\":\"65bf6c1f7d3fd1707043871.png\"}', 'basic', '2024-02-04 04:51:11', '2024-02-04 11:47:1