(107, 'evaluation_plan.element', '{\"has_image\":[\"1\"],\"title\":\"Study the optimal investment\",\"title_ar\":\"\\u062f\\u0631\\u0627\\u0633\\u0629 \\u0627\\u0644\\u0627\\u0633\\u062a\\u062b\\u0645\\u0627\\u0631 \\u0627\\u0644\\u0623\\u0645\\u062b\\u0644\",\"description\":\"<span style=\\\"color:rgb(66,66,66);font-family:Inter, sans-serif;letter-spacing:normal;\\\">For more than twenty years, our experience extends in providing specialized studies to study the optimal investment, evaluate the project idea, study the site and the region, and propose the required real estate products, including the market study of the expected selling price and the volume of demand available in the market, with an estimate of the development cost, leading to the creation of the development concept of the project.<\\/span>\",\"description_ar\":\"\\u0645\\u0646\\u0630 \\u0623\\u0643\\u062b\\u0631 \\u0645\\u0646 \\u0639\\u0634\\u0631\\u064a\\u0646 \\u0639\\u0627\\u0645\\u0627 \\u062a\\u0645\\u062a\\u062f \\u062e\\u0628\\u0631\\u062a\\u0646\\u0627 \\u0641\\u064a \\u062a\\u0642\\u062f\\u064a\\u0645 \\u0627\\u0644\\u062f\\u0631\\u0627\\u0633\\u0627\\u062a \\u0627\\u0644\\u0645\\u062a\\u062e\\u0635\\u0635\\u0629 \\u0644\\u062f\\u0631\\u0627\\u0633\\u0629 \\u0627\\u0644\\u0627\\u0633\\u062a\\u062b\\u0645\\u0627\\u0631 \\u0627\\u0644\\u0623\\u0645\\u062b\\u0644 \\u0648\\u062a\\u0642\\u064a\\u064a\\u0645 \\u0641\\u0643\\u0631\\u0629 \\u0627\\u0644\\u0645\\u0634\\u0631\\u0648\\u0639 \\u0648\\u062f\\u0631\\u0627\\u0633\\u0629 \\u0627\\u0644\\u0645\\u0648\\u0642\\u0639 \\u0648\\u0627\\u0644\\u0645\\u0646\\u0637\\u0642\\u0629 \\u0648\\u0627\\u0642\\u062a\\u0631\\u0627\\u062d \\u0627\\u0644\\u0645\\u0646\\u062a\\u062c\\u0627\\u062a \\u0627\\u0644\\u0639\\u0642\\u0627\\u0631\\u064a\\u0629 \\u0627\\u0644\\u0645\\u0637\\u0644\\u0648\\u0628\\u0629 \\u0628\\u0645\\u0627 \\u0641\\u064a \\u0630\\u0644\\u0643 \\u0627\\u0644\\u062f\\u0631\\u0627\\u0633\\u0629 \\u0627\\u0644\\u0633\\u0648\\u0642\\u064a\\u0629 \\u0644\\u0633\\u0639\\u0631 \\u0627\\u0644\\u0628\\u064a\\u0639 \\u0627\\u0644\\u0645\\u062a\\u0648\\u0642\\u0639 \\u0648\\u0633\\u0639\\u0631 \\u0627\\u0644\\u0628\\u064a\\u0639 \\u0627\\u0644\\u0645\\u062a\\u0648\\u0642\\u0639. \\u062d\\u062c\\u0645 \\u0627\\u0644\\u0637\\u0644\\u0628 \\u0627\\u0644\\u0645\\u062a\\u0648\\u0641\\u0631 \\u0641\\u064a \\u0627\\u0644\\u0633\\u0648\\u0642\\u060c \\u0645\\u0639 \\u062a\\u0642\\u062f\\u064a\\u0631 \\u062a\\u0643\\u0644\\u0641\\u0629 \\u0627\\u0644\\u062a\\u0637\\u0648\\u064a\\u0631\\u060c \\u0645\\u0645\\u0627 \\u064a\\u0624\\u062f\\u064a \\u0625\\u0644\\u0649 \\u062e\\u0644\\u0642 \\u0627\\u0644\\u0645\\u0641\\u0647\\u0648\\u0645 \\u0627\\u0644\\u062a\\u0637\\u0648\\u064a\\u0631\\u064a \\u0644\\u0644\\u0645\\u0634\\u0631\\u0648\\u0639.<br \\/>\",\"image\":\"65bf6c4fa7f9a1707043919.png\"}', 'basic', '2024-02-04 04:51:59', '2024-02-04 11:47:51'),
(108, 'evaluation_plan.element', '{\"has_image\":[\"1\"],\"title\":\"Study rehabilitation projects\",\"title_ar\":\"\\u062f\\u0631\\u0627\\u0633\\u0629 \\u0645\\u0634\\u0627\\u0631\\u064a\\u0639 \\u0625\\u0639\\u0627\\u062f\\u0629 \\u0627\\u0644\\u062a\\u0623\\u0647\\u064a\\u0644\",\"description\":\"<span style=\\\"color:rgb(66,66,66);font-family:Inter, sans-serif;letter-spacing:normal;\\\">We have direct and systematic relationships to rehabilitate projects through a wide network of relationships. We were able to know the strengths and opportunities and provide the partners with the available investment opportunities. Here, the company identifies the qualified projects based on reliability, as we present these projects professionally due to the privacy of this type of business, as we work to provide reports and study With the utmost honesty, professionalism, and creativity in proposing solutions to correct this stumble, which may be at the level of leadership and type of industry, or at the level of implementation, financing, and investment.<\\/span><br \\/>\",\"description_ar\":\"\\u0644\\u062f\\u064a\\u0646\\u0627 \\u0639\\u0644\\u0627\\u0642\\u0627\\u062a \\u0645\\u0628\\u0627\\u0634\\u0631\\u0629 \\u0648\\u0645\\u0646\\u0647\\u062c\\u064a\\u0629 \\u0644\\u0625\\u0639\\u0627\\u062f\\u0629 \\u062a\\u0623\\u0647\\u064a\\u0644 \\u0627\\u0644\\u0645\\u0634\\u0627\\u0631\\u064a\\u0639 \\u0645\\u0646 \\u062e\\u0644\\u0627\\u0644 \\u0634\\u0628\\u0643\\u0629 \\u0648\\u0627\\u0633\\u0639\\u0629 \\u0645\\u0646 \\u0627\\u0644\\u0639\\u0644\\u0627\\u0642\\u0627\\u062a. \\u062a\\u0645\\u0643\\u0646\\u0627 \\u0645\\u0646 \\u0645\\u0639\\u0631\\u0641\\u0629 \\u0646\\u0642\\u0627\\u0637 \\u0627\\u0644\\u0642\\u0648\\u0629 \\u0648\\u0627\\u0644\\u0641\\u0631\\u0635 \\u0648\\u062a\\u0632\\u0648\\u064a\\u062f \\u0627\\u0644\\u0634\\u0631\\u0643\\u0627\\u0621 \\u0628\\u0627\\u0644\\u0641\\u0631\\u0635 \\u0627\\u0644\\u0627\\u0633\\u062a\\u062b\\u0645\\u0627\\u0631\\u064a\\u0629 \\