(109, 'evaluation_plan.element', '{\"has_image\":[\"1\"],\"title\":\"Investment studies\",\"title_ar\":\"\\u062f\\u0631\\u0627\\u0633\\u0627\\u062a \\u0627\\u0644\\u0627\\u0633\\u062a\\u062b\\u0645\\u0627\\u0631\",\"description\":\"<small style=\\\"font-size:0.875em;color:rgb(66,66,66);font-family:Inter, sans-serif;letter-spacing:normal;\\\">Our methodology is done in two ways:<\\/small><span style=\\\"color:rgb(66,66,66);font-family:Inter, sans-serif;letter-spacing:normal;\\\"><\\/span><h6 style=\\\"color:rgb(66,66,66);font-family:Inter, sans-serif;letter-spacing:normal;\\\">First methodology<\\/h6><p style=\\\"color:rgb(66,66,66);font-family:Inter, sans-serif;letter-spacing:normal;\\\">According to the needs of the partner, when an investor requests Amlaek to provide him with the available commercial investment opportunities, and here the company identifies the qualified projects, whether they are industrial, commercial, service, raw lands, or projects that require rehabilitation or under development, and then study and compare between them and submit the study to the investor<\\/p><h6 style=\\\"color:rgb(66,66,66);font-family:Inter, sans-serif;letter-spacing:normal;\\\">Second methodology<\\/h6><p style=\\\"color:rgb(66,66,66);font-family:Inter, sans-serif;letter-spacing:normal;\\\">when the co-owners present their projects to search for solutions that include selling shares of their project for investment in front of interested parties, or exiting from the project or merging or acquiring, and here the study is done for this project and the best alternatives are determined to qualify the project and raise the value of the opportunity and the expected returns on investment.<\\/p>\",\"description_ar\":\"<div>\\u0645\\u0646\\u0647\\u062c\\u064a\\u062a\\u0646\\u0627 \\u062a\\u062a\\u0645 \\u0628\\u0637\\u0631\\u064a\\u0642\\u062a\\u064a\\u0646:<\\/div><div>\\u0627\\u0644\\u0645\\u0646\\u0647\\u062c\\u064a\\u0629 \\u0627\\u0644\\u0623\\u0648\\u0644\\u0649<\\/div><div>\\u062d\\u0633\\u0628 \\u0627\\u062d\\u062a\\u064a\\u0627\\u062c\\u0627\\u062a \\u0627\\u0644\\u0634\\u0631\\u064a\\u0643\\u060c \\u0639\\u0646\\u062f\\u0645\\u0627 \\u064a\\u0637\\u0644\\u0628 \\u0627\\u0644\\u0645\\u0633\\u062a\\u062b\\u0645\\u0631 \\u0645\\u0646 \\u0623\\u0645\\u0644\\u0627\\u0643 \\u062a\\u0648\\u0641\\u064a\\u0631 \\u0627\\u0644\\u0641\\u0631\\u0635 \\u0627\\u0644\\u0627\\u0633\\u062a\\u062b\\u0645\\u0627\\u0631\\u064a\\u0629 \\u0627\\u0644\\u062a\\u062c\\u0627\\u0631\\u064a\\u0629 \\u0627\\u0644\\u0645\\u062a\\u0627\\u062d\\u0629 \\u0644\\u0647\\u060c \\u0648\\u0647\\u0646\\u0627 \\u062a\\u0642\\u0648\\u0645 \\u0627\\u0644\\u0634\\u0631\\u0643\\u0629 \\u0628\\u062a\\u062d\\u062f\\u064a\\u062f \\u0627\\u0644\\u0645\\u0634\\u0627\\u0631\\u064a\\u0639 \\u0627\\u0644\\u0645\\u0624\\u0647\\u0644\\u0629 \\u0633\\u0648\\u0627\\u0621 \\u0643\\u0627\\u0646\\u062a \\u0635\\u0646\\u0627\\u0639\\u064a\\u0629 \\u0623\\u0648 \\u062a\\u062c\\u0627\\u0631\\u064a\\u0629 \\u0623\\u0648 \\u062e\\u062f\\u0645\\u064a\\u0629 \\u0623\\u0648 \\u0623\\u0631\\u0627\\u0636\\u064a \\u062e\\u0627\\u0645 \\u0623\\u0648 \\u0645\\u0634\\u0627\\u0631\\u064a\\u0639 \\u062a\\u062d\\u062a\\u0627\\u062c \\u0625\\u0644\\u0649 \\u0625\\u0639\\u0627\\u062f\\u0629 \\u062a\\u0623\\u0647\\u064a\\u0644 \\u0623\\u0648 \\u0642\\u064a\\u062f \\u0627\\u0644\\u062a\\u0637\\u0648\\u064a\\u0631 \\u0648\\u0645\\u0646 \\u062b\\u0645 \\u062f\\u0631\\u0627\\u0633\\u062a\\u0647\\u0627 \\u0648\\u0627\\u0644\\u0645\\u0642\\u0627\\u0631\\u0646\\u0629 \\u0628\\u064a\\u0646\\u0647\\u0645\\u0627 \\u0648\\u062a\\u0642\\u062f\\u064a\\u0645 \\u0627\\u0644\\u062f\\u0631\\u0627\\u0633\\u0629 \\u0644\\u0644\\u0645\\u0633\\u062a\\u062b\\u0645\\u0631<\\/div><div><br \\/><\\/div><div>\\u0627\\u0644\\u0645\\u0646\\u0647\\u062c\\u064a\\u0629 \\u0627\\u0644\\u062b\\u0627\\u0646\\u064a\\u0629<\\/div><div>\\u0639\\u0646\\u062f\\u0645\\u0627 \\u064a\\u0639\\u0631\\u0636 \\u0627\\u0644\\u0634\\u0631\\u0643\\u0627\\u0621