(110, 'evaluation_plan.element', '{\"has_image\":[\"1\"],\"title\":\"Reports and statistical studies\",\"title_ar\":\"\\u0627\\u0644\\u062a\\u0642\\u0627\\u0631\\u064a\\u0631 \\u0648\\u0627\\u0644\\u062f\\u0631\\u0627\\u0633\\u0627\\u062a \\u0627\\u0644\\u0625\\u062d\\u0635\\u0627\\u0626\\u064a\\u0629\",\"description\":\"<span style=\\\"color:rgb(66,66,66);font-family:Inter, sans-serif;letter-spacing:normal;\\\">Through the data incubator as one of the specialized partners, we offer many analyzes of the Department of Statistical Studies and Reports and come up with recommendations of reports and practical steps that guide customers and partners to proceed and work according to the best scenarios for success in the market and deal positively with these assessments, whether reports are on demand or periodic reports every three months to show the situation existing market<\\/span><br \\/>\",\"description_ar\":\"\\u0645\\u0646 \\u062e\\u0644\\u0627\\u0644 \\u062d\\u0627\\u0636\\u0646\\u0629 \\u0627\\u0644\\u0628\\u064a\\u0627\\u0646\\u0627\\u062a \\u0643\\u0623\\u062d\\u062f \\u0627\\u0644\\u0634\\u0631\\u0643\\u0627\\u0621 \\u0627\\u0644\\u0645\\u062a\\u062e\\u0635\\u0635\\u064a\\u0646 \\u0646\\u0642\\u062f\\u0645 \\u0627\\u0644\\u0639\\u062f\\u064a\\u062f \\u0645\\u0646 \\u0627\\u0644\\u062a\\u062d\\u0644\\u064a\\u0644\\u0627\\u062a \\u0627\\u0644\\u062e\\u0627\\u0635\\u0629 \\u0628\\u0642\\u0633\\u0645 \\u0627\\u0644\\u062f\\u0631\\u0627\\u0633\\u0627\\u062a \\u0648\\u0627\\u0644\\u062a\\u0642\\u0627\\u0631\\u064a\\u0631 \\u0627\\u0644\\u0625\\u062d\\u0635\\u0627\\u0626\\u064a\\u0629 \\u0648\\u0627\\u0644\\u062e\\u0631\\u0648\\u062c \\u0628\\u062a\\u0648\\u0635\\u064a\\u0627\\u062a \\u0627\\u0644\\u062a\\u0642\\u0627\\u0631\\u064a\\u0631 \\u0648\\u0627\\u0644\\u062e\\u0637\\u0648\\u0627\\u062a \\u0627\\u0644\\u0639\\u0645\\u0644\\u064a\\u0629 \\u0627\\u0644\\u062a\\u064a \\u062a\\u0631\\u0634\\u062f \\u0627\\u0644\\u0639\\u0645\\u0644\\u0627\\u0621 \\u0648\\u0627\\u0