(111, 'about_section.content', '{\"has_image\":\"1\",\"heading\":\"About Technical Incubator\",\"heading_ar\":\"\\u0639\\u0646 \\u062d\\u0627\\u0636\\u0646\\u0629 \\u0627\\u0644\\u062a\\u0643\\u0646\\u0648\\u0644\\u0648\\u062c\\u064a\\u0627\",\"sub_heading\":\"About Technical Incubator\",\"sub_heading_ar\":\"\\u0639\\u0646 \\u062d\\u0627\\u0636\\u0646\\u0629 \\u0627\\u0644\\u062a\\u0643\\u0646\\u0648\\u0644\\u0648\\u062c\\u064a\\u0627\",\"title\":\"About Technical Incubator\",\"title_ar\":\"\\u0639\\u0646 \\u062d\\u0627\\u0636\\u0646\\u0629 \\u0627\\u0644\\u062a\\u0643\\u0646\\u0648\\u0644\\u0648\\u062c\\u064a\\u0627\",\"description\":\"<p class=\\\"MsoNormal\\\" style=\\\"background:#DBDBDB;\\\"><b><span style=\\\"font-size:13.5pt;line-height:107%;font-family:\'Times New Roman\', serif;\\\">About\\nUs<\\/span><\\/b><\\/p><p><b><\\/b><\\/p><b><\\/b><p class=\\\"MsoNormal\\\"><b><span style=\\\"font-size:12pt;line-height:107%;font-family:\'Times New Roman\', serif;\\\">Teincu \\u2013Technical Incubator<\\/span><\\/b><span style=\\\"font-size:12pt;line-height:107%;font-family:\'Times New Roman\', serif;\\\"> is a digital marketplace that\\nbrings together a wide range of smart and integrated technology services,\\nconnecting businesses and entrepreneurs with verified service providers across\\nspecialized tech sectors.<\\/span><\\/p><p><\\/p><p class=\\\"MsoNormal\\\"><span style=\\\"font-size:12pt;line-height:107%;font-family:\'Times New Roman\', serif;\\\">We operate as a trusted intermediary\\nbetween clients and vendors. Our intelligent service request forms and\\ndedicated dashboards ensure seamless access to the right solutions, enabling\\nfaster service delivery and high privacy standards.<\\/span><\\/p><p><\\/p><p class=\\\"MsoNormal\\\"><b><span style=\\\"font-size:13.5pt;line-height:107%;font-family:\'Times New Roman\', serif;\\\">What\\nWe Offer<\\/span><\\/b><\\/p><p><b><\\/b><\\/p><b><\\/b><p class=\\\"MsoNormal\\\"><span style=\\\"font-size:12pt;line-hei