(122, 'marketing_service.element', '{\"has_image\":[\"1\"],\"title\":\"Running advertising campaigns\",\"title_ar\":\"\\u062a\\u0634\\u063a\\u064a\\u0644 \\u0627\\u0644\\u062d\\u0645\\u0644\\u0627\\u062a \\u0627\\u0644\\u0625\\u0639\\u0644\\u0627\\u0646\\u064a\\u0629\",\"description\":\"<span style=\\\"color:rgb(108,117,125);font-family:Inter, sans-serif;letter-spacing:normal;\\\">Advertising campaign management services start with comprehensive planning and application of the best media plans and strategies for disseminating advertising content, distributing the budget allocated for advertising on the appropriate communication platforms, and we follow up on the results of the campaign over the period to ensure and improve the results according to the data collected first-hand.<\\/span><br \\/>\",\"description_ar\":\"\\u062a\\u0628\\u062f\\u0623 \\u062e\\u062f\\u0645\\u0627\\u062a \\u0625\\u062f\\u0627\\u0631\\u0629 \\u0627\\u0644\\u062d\\u0645\\u0644\\u0627\\u062a \\u0627\\u0644\\u0625\\u0639\\u0644\\u0627\\u0646\\u064a\\u0629 \\u0628\\u0627\\u0644\\u062a\\u062e\\u0637\\u064a\\u0637 \\u0627\\u0644\\u0634\\u0627\\u0645\\u0644 \\u0648\\u062a\\u0637\\u0628\\u064a\\u0642 \\u0623\\u0641\\u0636\\u0644 \\u0627\\u0644\\u062e\\u0637\\u0637 \\u0648\\u0627\\u0644\\u0627\\u0633\\u062a\\u0631\\u0627\\u062a\\u064a\\u062c\\u064a\\u0627\\u062a \\u0627\\u0644\\u0625\\u0639\\u0644\\u0627\\u0645\\u064a\\u0629 \\u0644\\u0646\\u0634\\u0631 \\u0627\\u0644\\u0645\\u062d\\u062a\\u0648\\u0649 \\u0627\\u0644\\u0625\\u0639\\u0644\\u0627\\u0646\\u064a\\u060c \\u0648\\u062a\\u0648\\u0632\\u064a\\u0639 \\u0627\\u0644\\u0645\\u064a\\u0632\\u0627\\u0646\\u064a\\u0629 \\u0627\\u0644\\u0645\\u062e\\u0635\\u0635\\u0629 \\u0644\\u0644\\u0625\\u0639\\u0644\\u0627\\u0646 \\u0639\\u0644\\u0649 \\u0645\\u0646\\u0635\\u0627\\u062a \\u0627\\u0644\\u062a\\u0648\\u0627\\u0635\\u0644 \\u0627\\u0644\\u0645\\u0646\\u0627\\u0633\\u0628\\u0629\\u060c \\u0648\\u0646\\u0642\\u0648\\u0645 \\u0628\\u0645\\u062a\\u062