(123, 'marketing_service.element', '{\"has_image\":[\"1\"],\"title\":\"Integrated identity design\",\"title_ar\":\"\\u062a\\u0635\\u0645\\u064a\\u0645 \\u0647\\u0648\\u064a\\u0629 \\u0645\\u062a\\u0643\\u0627\\u0645\\u0644\\u0629\",\"description\":\"<span style=\\\"color:rgb(108,117,125);font-family:Inter, sans-serif;letter-spacing:normal;\\\">Designing logos for brands, creating names of brands, products, services, and titles of advertising campaigns in both Arabic and English, designing advertising publications in support of advertising campaigns, and building promotional cartoon characters for those campaigns.<\\/span><br \\/>\",\"description_ar\":\"<font color=\\\"#6c757d\\\" face=\\\"Inter, sans-serif\\\"><span style=\\\"letter-spacing:normal;\\\">\\u062a\\u0635\\u0645\\u064a\\u0645 \\u0627\\u0644\\u0634\\u0639\\u0627\\u0631\\u0627\\u062a \\u0644\\u0644\\u0639\\u0644\\u0627\\u0645\\u0627\\u062a \\u0627\\u0644\\u062a\\u062c\\u0627\\u0631\\u064a\\u0629 \\u0648\\u0625\\u0646\\u0634\\u0627\\u0621 \\u0623\\u0633\\u0645\\u0627\\u0621 \\u0627\\u0644\\u0639\\u0644\\u0627\\u0645\\u0627\\u062a \\u0627\\u0644\\u062a\\u062c\\u0627\\u0631\\u064a\\u0629 \\u0648\\u0627\\u0644\\u0645\\u0646\\u062a\\u062c\\u0627\\u062a \\u0648\\u0627\\u0644\\u062e\\u062f\\u0645\\u0627\\u062a \\u0648\\u0639\\u0646\\u0627\\u0648\\u064a\\u0646 \\u0627\\u0644\\u062d\\u0645\\u0644\\u0627\\u062a \\u0627\\u0644\\u0625\\u0639\\u0644\\u0627\\u0646\\u064a\\u0629 \\u0628\\u0627\\u0644\\u0644\\u063a\\u062a\\u064a\\u0646 \\u0627\\u0644\\u0639\\u0631\\u0628\\u064a\\u0629 \\u0648\\u0627\\u0644\\u0625\\u0646\\u062c\\u0644\\u064a\\u0632\\u064a\\u0629\\u060c \\u0648\\u062a\\u0635\\u0645\\u064a\\u0645 \\u0627\\u0644\\u0645\\u0637\\u0628\\u0648\\u0639\\u0627\\u062a \\u0627\\u0644\\u0625\\u0639\\u0644\\u0627\\u0646\\u064a\\u0629 \\u0627\\u0644\\u062f\\u0627\\u0639\\u0645\\u0629 \\u0644\\u0644\\u062d\\u0645\\u0644\\u0627\\u062a \\u0627\\u0644\\u0625\\u0639\\u0644\\u0627\\u0646\\u064a\\u0629\\u060c \\u0648\\u0628\\u0