(124, 'marketing_service.element', '{\"has_image\":[\"1\"],\"title\":\"Infographic video design\",\"title_ar\":\"\\u062a\\u0635\\u0645\\u064a\\u0645 \\u0641\\u064a\\u062f\\u064a\\u0648 \\u0627\\u0646\\u0641\\u0648\\u062c\\u0631\\u0627\\u0641\\u064a\\u0643\",\"description\":\"<span style=\\\"color:rgb(108,117,125);font-family:Inter, sans-serif;letter-spacing:normal;\\\">Motion graphics videos are widely used in marketing now because they present the marketing idea in a more professional and interesting way. Motion graphics videos enable users to communicate the marketing idea of the brand in an appropriate and attractive manner at the same time.<\\/span><br \\/>\",\"description_ar\":\"\\u062a\\u064f\\u0633\\u062a\\u062e\\u062f\\u0645 \\u0645\\u0642\\u0627\\u0637\\u0639 \\u0627\\u0644\\u0641\\u064a\\u062f\\u064a\\u0648 \\u0627\\u0644\\u0645\\u062a\\u062d\\u0631\\u0643\\u0629 \\u0639\\u0644\\u0649 \\u0646\\u0637\\u0627\\u0642 \\u0648\\u0627\\u0633\\u0639 \\u0641\\u064a \\u0627\\u0644\\u062a\\u0633\\u0648\\u064a\\u0642 \\u0627\\u0644\\u0622\\u0646 \\u0644\\u0623\\u0646\\u0647\\u0627 \\u062a\\u0642\\u062f\\u0645 \\u0627\\u0644\\u0641\\u0643\\u0631\\u0629 \\u0627\\u0644\\u062a\\u0633\\u0648\\u064a\\u0642\\u064a\\u0629 \\u0628\\u0637\\u0631\\u064a\\u0642\\u0629 \\u0623\\u0643\\u062b\\u0631 \\u0627\\u062d\\u062a\\u0631\\u0627\\u0641\\u064a\\u0629 \\u0648\\u0645\\u062b\\u064a\\u0631\\u0629 \\u0644\\u0644\\u0627\\u0647\\u062a\\u0645\\u0627\\u0645. \\u0641\\u064a\\u062f\\u064a\\u0648\\u0647\\u0627\\u062a \\u0627\\u0644\\u0645\\u0648\\u0634\\u0646 \\u062c\\u0631\\u0627\\u0641\\u064a\\u0643 \\u062a\\u0645\\u0643\\u0646 \\u0627\\u0644\\u0645\\u0633\\u062a\\u062e\\u062f\\u0645\\u064a\\u0646 \\u0645\\u0646 \\u0625\\u064a\\u0635\\u0627\\u0644 \\u0627\\u0644\\u0641\\u0643\\u0631\\u0629 \\u0627\\u0644\\u062a\\u0633\\u0648\\u064a\\u0642\\u064a\\u0629 \\u0644\\u0644\\u0639\\u0644\\u0627\\u0645\\u0629 \\u0627\\u0644\\u062a\\u062c\\u0627\\u0631\\u064a\\u0629 \\u0628\\u0637\\u0631\\u064a\\