(125, 'marketing_service.element', '{\"has_image\":[\"1\"],\"title\":\"Design services\",\"title_ar\":\"\\u062e\\u062f\\u0645\\u0627\\u062a \\u0627\\u0644\\u062a\\u0635\\u0645\\u064a\\u0645\",\"description\":\"<span style=\\\"color:rgb(108,117,125);font-family:Inter, sans-serif;letter-spacing:normal;\\\">Graphic designs, whether for individuals or companies, are considered one of the important and necessary marketing tools in the modern era. And because technology is constantly evolving, so also the means and tools we use in marketing operations must be appropriate for this development. Therefore, graphic design is an important element of marketing, whether regular marketing or e-marketing.<\\/span><br \\/>\",\"description_ar\":\"\\u062a\\u0639\\u062a\\u0628\\u0631 \\u0627\\u0644\\u062a\\u0635\\u0645\\u064a\\u0645\\u0627\\u062a \\u0627\\u0644\\u062c\\u0631\\u0627\\u0641\\u064a\\u0643\\u064a\\u0629 \\u0633\\u0648\\u0627\\u0621 \\u0644\\u0644\\u0623\\u0641\\u0631\\u0627\\u062f \\u0623\\u0648 \\u0627\\u0644\\u0634\\u0631\\u0643\\u0627\\u062a \\u0645\\u0646 \\u0627\\u0644\\u0623\\u062f\\u0648\\u0627\\u062a \\u0627\\u0644\\u062a\\u0633\\u0648\\u064a\\u0642\\u064a\\u0629 \\u0627\\u0644\\u0647\\u0627\\u0645\\u0629 \\u0648\\u0627\\u0644\\u0636\\u0631\\u0648\\u0631\\u064a\\u0629 \\u0641\\u064a \\u0627\\u0644\\u0639\\u0635\\u0631 \\u0627\\u0644\\u062d\\u062f\\u064a\\u062b. \\u0648\\u0644\\u0623\\u0646 \\u0627\\u0644\\u062a\\u0643\\u0646\\u0648\\u0644\\u0648\\u062c\\u064a\\u0627 \\u0641\\u064a \\u062a\\u0637\\u0648\\u0631 \\u0645\\u0633\\u062a\\u0645\\u0631\\u060c \\u0643\\u0630\\u0644\\u0643 \\u0641\\u0625\\u0646 \\u0627\\u0644\\u0648\\u0633\\u0627\\u0626\\u0644 \\u0648\\u0627\\u0644\\u0623\\u062f\\u0648\\u0627\\u062a \\u0627\\u0644\\u062a\\u064a \\u0646\\u0633\\u062a\\u062e\\u062f\\u0645\\u0647\\u0627 \\u0641\\u064a \\u0639\\u0645\\u0644\\u064a\\u0627\\u062a \\u0627\\u0644\\u062a\\u0633\\u0648\\u064a\\u0642 \\u064a\\u062c\\u0628 \\u0623\\u0646 \\u062a\\u0643\\u0648\\u0646 \\