(149, 'rehabilitation_empowerment.content', '{\"has_image\":\"1\",\"description\":\"\\\"Rehabilitation for Empowerment\\\" is a program affiliated with business incubators, the corporate factory, which aims to qualify at least 10,000 individuals through its wide network of partners as a unique program specialized in rehabilitation for employment and social investment for organizations and individuals by building a partnership between the government and private sectors and the third non-profit sector. The mission is to transform society from Pastoral to developmental through increasing local content, improving the standard of living, obtaining job opportunities, addressing the problem of unemployment among members of society, bridging the gap between the needs of the labor market and guidance, building personal skills among community members, attracting talents and transferring experiences.\",\"description_ar\":\"\\\"\\u0627\\u0644\\u062a\\u0623\\u0647\\u064a\\u0644 \\u0645\\u0646 \\u0623\\u062c\\u0644 \\u0627\\u0644\\u062a\\u0645\\u0643\\u064a\\u0646\\\" \\u0647\\u0648 \\u0628\\u0631\\u0646\\u0627\\u0645\\u062c \\u062a\\u0627\\u0628\\u0639 \\u0644\\u062d\\u0627\\u0636\\u0646\\u0627\\u062a \\u0627\\u0644\\u0623\\u0639\\u0645\\u0627\\u0644 \\u060c \\u0645\\u0635\\u0646\\u0639 \\u0627\\u0644\\u0634\\u0631\\u0643\\u0629 \\u060c \\u0648\\u064a\\u0647\\u062f\\u0641 \\u0625\\u0644\\u0649 \\u062a\\u0623\\u0647\\u064a\\u0644 \\u0645\\u0627 \\u0644\\u0627 \\u064a\\u0642\\u0644 \\u0639\\u0646 10000 \\u0641\\u0631\\u062f \\u0645\\u0646 \\u062e\\u0644\\u0627\\u0644 \\u0634\\u0628\\u0643\\u0629 \\u0648\\u0627\\u0633\\u0639\\u0629 \\u0645\\u0646 \\u0627\\u0644\\u0634\\u0631\\u0643\\u0627\\u0621 \\u0643\\u0628\\u0631\\u0646\\u0627\\u0645\\u062c \\u0641\\u0631\\u064a\\u062f \\u0645\\u062a\\u062e\\u0635\\u0635 \\u0641\\u064a \\u0625\\u0639\\u0627\\u062f\\u0629 \\u0627\\u0644\\u062a\\u0623\\u0647\\u064a\\u0644 \\u0644\\u0644\\u062a\\u0648\\u0638\\u064a\\u0641 \\u0648\\u0627\\u0644\\u0