(201, 'service_section.element', '{\"has_image\":\"1\",\"title\":\"Reconciling relations\",\"title_ar\":\"\\u0625\\u0635\\u0644\\u0627\\u062d \\u0630\\u0627\\u062a \\u0627\\u0644\\u0628\\u064a\\u0646\",\"short_description\":\"We fully believe Amlaek in the importance of eliminating the causes of disputes and conflict, through tolerance and forgiveness, or by mutual consent. This is represented in the importance of reconciling relations between a single family, partners and family companies.\",\"short_description_ar\":\"\\u0646\\u062d\\u0646 \\u0646\\u0648\\u0645\\u0646 \\u0627\\u064a\\u0645\\u0627\\u0646 \\u062a\\u0627\\u0645 \\u0641\\u064a \\u062a\\u0646\\u0645\\u064a\\u0629 \\u0627\\u0644\\u0627\\u0645\\u0644\\u0627\\u0643 \\u0628\\u0623\\u0647\\u0645\\u064a\\u0629 \\u0625\\u0632\\u0627\\u0644\\u0629 \\u0623\\u0633\\u0628\\u0627\\u0628 \\u0627\\u0644\\u062e\\u0635\\u0627\\u0645 \\u0648\\u0627\\u0644\\u0646\\u0632\\u0627\\u0639\\u060c \\u0628\\u0627\\u0644\\u062a\\u0651\\u0633\\u0627\\u0645\\u062d \\u0648\\u0627\\u0644\\u0639\\u0641\\u0648\\u060c \\u0623\\u0648 \\u0628\\u0627\\u0644\\u062a\\u0651\\u0631\\u0627\\u0636\\u064a, \\u0648\\u064a\\u062a\\u0645\\u062b\\u0644 \\u0630\\u0644\\u0643 \\u0628\\u0623\\u0647\\u0645\\u064a\\u0629 \\u0627\\u0635\\u0644\\u0627\\u062d \\u0627\\u0644\\u0628\\u064a\\u0646 \\u0628\\u064a\\u0646 \\u0627\\u0644\\u0627\\u0633\\u0631\\u0629 \\u0627\\u0644\\u0648\\u0627\\u062d\\u062f\\u0629 \\u0648\\u0627\\u0644\\u0634\\u0631\\u0643\\u0627\\u0621 \\u0648\\u0627\\u0644\\u0634\\u0631\\u0643\\u0627\\u062a \\u0627\\u0644\\u0639\\u0627\\u0626\\u0644\\u064a\\u0629\",\"button_url\":\"service-request\",\"image\":\"65f87128af1e51710780712.png\"}', NULL, '2024-03-18 15:51:52', '2024-03-18 15:51:52'),
