(203, 'service_section.element', '{\"has_image\":\"1\",\"title\":\"Project processing\",\"title_ar\":\"\\u0645\\u0639\\u0627\\u0644\\u062c\\u0629 \\u0627\\u0644\\u0645\\u0634\\u0627\\u0631\\u064a\\u0639\",\"short_description\":\"Providing all solutions for treatment according to the status of each stalled project\\n1. Rehabilitation of the project.\\n2. Refinancing the project.\\n3. Scheduling installments for bad debt.\\n4. Transferring the debt to a new investor.\\n5. Renting the project to an investor who wants to invest without transferring ownership.\\n6. The defaulter enters into a partnership with a new investor.\\n7. Coordination with the Ministry of Agriculture, Water and Environment regarding licenses, such as changing activity, renewing the license, etc.\",\"short_description_ar\":\"\\u062a\\u0642\\u062f\\u064a\\u0645 \\u0643\\u0627\\u0641\\u0629 \\u0627\\u0644\\u062d\\u0644\\u0648\\u0644 \\u0644\\u0644\\u0645\\u0639\\u0627\\u0644\\u062c\\u0629 \\u062d\\u0633\\u0628 \\u062d\\u0627\\u0644\\u0629 \\u0643\\u0644 \\u0645\\u0634\\u0631\\u0648\\u0639 \\u0645\\u062a\\u0639\\u062b\\u0631 \\n1.\\t\\u0625\\u0639\\u0627\\u062f\\u0629 \\u062a\\u0623\\u0647\\u064a\\u0644 \\u0627\\u0644\\u0645\\u0634\\u0631\\u0648\\u0639.\\n2.\\t\\u0625\\u0639\\u0627\\u062f\\u0629 \\u062a\\u0645\\u0648\\u064a\\u0644 \\u0627\\u0644\\u0645\\u0634\\u0631\\u0648\\u0639.\\n3.\\t\\u062c\\u062f\\u0648\\u0644\\u0629 \\u0623\\u0642\\u0633\\u0627\\u0637 \\u0627\\u0644\\u062f\\u064a\\u0646 \\u0627\\u0644\\u0645\\u062a\\u0639\\u062b\\u0631.\\n4.\\t\\u0646\\u0642\\u0644 \\u0627\\u0644\\u0645\\u062f\\u064a\\u0648\\u0646\\u064a\\u0629 \\u0644\\u0645\\u0633\\u062a\\u062b\\u0645\\u0631 \\u062c\\u062f\\u064a\\u062f.\\n5.\\t\\u062a\\u0623\\u062c\\u064a\\u0631 \\u0627\\u0644\\u0645\\u0634\\u0631\\u0648\\u0639 \\u0644\\u0645\\u0633\\u062a\\u062b\\u0645\\u0631 \\u064a\\u0631\\u063a\\u0628 \\u0628\\u0627\\u0644\\u0627\\u0633\\u062a\\u062b\\u0645\\u0627\\u0631 \\u062f\\u0648\\u0646 \\u0646\\u0642\\u0644 \\u06