(244, 'area_opportunity_banner.content', '{\"has_image\":\"1\",\"description\":\"<span style=\\\"font-family:Century, ArbFONTS;font-size:16px;letter-spacing:normal;\\\">The Kingdom of Saudi Arabia is concerned with its economy and prosperity, and aims to be an attractive and stimulating investment destination for continuity and expansion; Therefore, a ministry concerned with investment designated one of its most important tasks to enable investors to access investment opportunities, provide them with facilities and flexibility, and other services.<\\/span><br \\/>\",\"description_ar\":\"\\u062a\\u0647\\u062a\\u0645 \\u0627\\u0644\\u0645\\u0645\\u0644\\u0643\\u0629 \\u0627\\u0644\\u0639\\u0631\\u0628\\u064a\\u0629 \\u0627\\u0644\\u0633\\u0639\\u0648\\u062f\\u064a\\u0629 \\u0628\\u0627\\u0642\\u062a\\u0635\\u0627\\u062f\\u0647\\u0627 \\u0648\\u0627\\u0632\\u062f\\u0647\\u0627\\u0631\\u0647\\u0627\\u060c \\u0648\\u062a\\u0647\\u062f\\u0641 \\u0625\\u0644\\u0649 \\u0623\\u0646 \\u062a\\u0643\\u0648\\u0646 \\u0648\\u062c\\u0647\\u0629 \\u0627\\u0633\\u062a\\u062b\\u0645\\u0627\\u0631\\u064a\\u0629 \\u062c\\u0627\\u0630\\u0628\\u0629 \\u0648\\u0645\\u062d\\u0641\\u0632\\u0629 \\u0644\\u0644\\u0627\\u0633\\u062a\\u0645\\u0631\\u0627\\u0631\\u064a\\u0629 \\u0648\\u0627\\u0644\\u062a\\u0648\\u0633\\u0639\\u061b \\u0644\\u0630\\u0644\\u0643 \\u062e\\u0635\\u0635\\u062a \\u0648\\u0632\\u0627\\u0631\\u0629 \\u0645\\u0639\\u0646\\u064a\\u0629 \\u0628\\u0627\\u0644\\u0627\\u0633\\u062a\\u062b\\u0645\\u0627\\u0631 \\u0623\\u062d\\u062f \\u0623\\u0647\\u0645 \\u0645\\u0647\\u0627\\u0645\\u0647\\u0627 \\u0644\\u062a\\u0645\\u0643\\u064a\\u0646 \\u0627\\u0644\\u0645\\u0633\\u062a\\u062b\\u0645\\u0631\\u064a\\u0646 \\u0645\\u0646 \\u0627\\u0644\\u0648\\u0635\\u0648\\u0644 \\u0625\\u0644\\u0649 \\u0627\\u0644\\u0641\\u0631\\u0635 \\u0627\\u0644\\u0627\\u0633\\u062a\\u062b\\u0645\\u0627\\u0631\\u064a\\u0629\\u060c \\u0648\\u062a\\u0648\\u0641\\u064a\\u0631 \\u0627\\u0644\\u062a\\u0633\\