(246, 'franchise.content', '{\"title\":\"Franchise\",\"title_ar\":\"\\u0627\\u0644\\u0627\\u0645\\u062a\\u064a\\u0627\\u0632 \\u0627\\u0644\\u062a\\u062c\\u0627\\u0631\\u064a\",\"description\":\"<span style=\\\"font-family:Century, ArbFONTS;font-size:16px;font-weight:700;letter-spacing:normal;\\\">If you are looking for a guaranteed investment opportunity, Franchise projects are considered one of the most profitable projects ever. As you do not need to start your own brand, but you can rely on an existing and already famous brand to attract a lot of customers and promote your products and services very quickly.<\\/span><br \\/>\",\"description_ar\":\"\\u0625\\u0630\\u0627 \\u0643\\u0646\\u062a \\u062a\\u0628\\u062d\\u062b \\u0639\\u0646 \\u0641\\u0631\\u0635\\u0629 \\u0627\\u0633\\u062a\\u062b\\u0645\\u0627\\u0631\\u064a\\u0629 \\u0645\\u0636\\u0645\\u0648\\u0646\\u0629\\u060c \\u0641\\u0625\\u0646 \\u0645\\u0634\\u0627\\u0631\\u064a\\u0639 \\u0627\\u0644\\u0627\\u0645\\u062a\\u064a\\u0627\\u0632 \\u062a\\u0639\\u062a\\u0628\\u0631 \\u0645\\u0646 \\u0623\\u0643\\u062b\\u0631 \\u0627\\u0644\\u0645\\u0634\\u0627\\u0631\\u064a\\u0639 \\u0631\\u0628\\u062d\\u064a\\u0629 \\u0639\\u0644\\u0649 \\u0627\\u0644\\u0625\\u0637\\u0644\\u0627\\u0642. \\u062d\\u064a\\u062b \\u0623\\u0646\\u0643 \\u0644\\u0627 \\u062a\\u062d\\u062a\\u0627\\u062c \\u0625\\u0644\\u0649 \\u0625\\u0646\\u0634\\u0627\\u0621 \\u0639\\u0644\\u0627\\u0645\\u062a\\u0643 \\u0627\\u0644\\u062a\\u062c\\u0627\\u0631\\u064a\\u0629 \\u0627\\u0644\\u062e\\u0627\\u0635\\u0629\\u060c \\u0648\\u0644\\u0643\\u0646 \\u064a\\u0645\\u0643\\u0646\\u0643 \\u0627\\u0644\\u0627\\u0639\\u062a\\u0645\\u0627\\u062f \\u0639\\u0644\\u0649 \\u0639\\u0644\\u0627\\u0645\\u0629 \\u062a\\u062c\\u0627\\u0631\\u064a\\u0629 \\u0645\\u0648\\u062c\\u0648\\u062f\\u0629 \\u0648\\u0645\\u0634\\u0647\\u0648\\u0631\\u0629 \\u0628\\u0627\\u0644\\u0641\\u0639\\u0644 \\u0644\\u062c\\u0630\\u0628 \\u0627\\u0644\\u0643\\u062b\\u064a\\u0631 \\u0645\