(332, 'our_message.content', '{\"has_image\":\"1\",\"message_title\":\"OUR MESSAGE\",\"message_title_ar\":\"\\u0631\\u0633\\u0627\\u0644\\u062a\\u0646\\u0627\",\"message_text\":\"<p class=\\\"MsoNormal\\\"><span style=\\\"font-size:12pt;line-height:107%;font-family:\'Times New Roman\', serif;\\\">To empower individuals and\\nbusinesses by facilitating access to trusted technology solutions through a\\nseamless, AI-powered experience, supported by strong cybersecurity and a\\nreliable vendor network.<\\/span><\\/p><p><\\/p><p><\\/p>\",\"message_text_ar\":\"<p class=\\\"MsoNormal\\\" dir=\\\"rtl\\\"><span lang=\\\"ar-sa\\\" style=\\\"font-size:12pt;line-height:107%;font-family:\'Times New Roman\', serif;\\\" xml:lang=\\\"ar-sa\\\">\\u062a\\u0645\\u0643\\u064a\\u0646 \\u0627\\u0644\\u0623\\u0641\\u0631\\u0627\\u062f \\u0648\\u0627\\u0644\\u0634\\u0631\\u0643\\u0627\\u062a \\u0645\\u0646 \\u0627\\u0644\\u0648\\u0635\\u0648\\u0644 \\u0625\\u0644\\u0649\\n\\u062e\\u062f\\u0645\\u0627\\u062a \\u062a\\u0642\\u0646\\u064a\\u0629 \\u0645\\u0648\\u062b\\u0648\\u0642\\u0629 \\u0648\\u0641\\u0639\\u0627\\u0644\\u0629\\u060c \\u0645\\u0646 \\u062e\\u0644\\u0627\\u0644 \\u0631\\u0628\\u0637\\u0647\\u0645 \\u0628\\u0634\\u0628\\u0643\\u0629 \\u0645\\u0646 \\u0627\\u0644\\u0645\\u0648\\u0631\\u062f\\u064a\\u0646 \\u0627\\u0644\\u0645\\u062a\\u0645\\u064a\\u0632\\u064a\\u0646\\u060c \\u0639\\u0628\\u0631 \\u062a\\u062c\\u0631\\u0628\\u0629\\n\\u0633\\u0644\\u0633\\u0629 \\u0648\\u0645\\u0624\\u062a\\u0645\\u062a\\u0629\\u060c \\u062a\\u062f\\u0639\\u0645\\u0647\\u0627 \\u062a\\u0642\\u0646\\u064a\\u0627\\u062a \\u0627\\u0644\\u0630\\u0643\\u0627\\u0621 \\u0627\\u0644\\u0627\\u0635\\u0637\\u0646\\u0627\\u0639\\u064a \\u0648\\u062a\\u062d\\u0645\\u064a\\u0647\\u0627 \\u0623\\u0639\\u0644\\u0649 \\u0645\\u0639\\u0627\\u064a\\u064a\\u0631 \\u0627\\u0644\\u0623\\u0645\\u0646\\n\\u0627\\u0644\\u0633\\u064a\\u0628\\u0631\\u0627\\u0646\\u064a<\\/span><span dir=\\\"ltr\\\"><\\/span><span dir=