(333, 'our_vision_and_mission.content', '{\"has_image\":\"1\",\"vision_title\":\"OUR VISION\",\"vision_title_ar\":\"\\u0631\\u0624\\u064a\\u062a\\u0646\\u0627\",\"vision_text\":\"<p class=\\\"MsoNormal\\\"><span style=\\\"font-size:12pt;line-height:107%;font-family:\'Times New Roman\', serif;\\\">To become the leading regional\\nplatform for requesting and delivering high-quality technology services \\u2014\\npowered by artificial intelligence, driven by innovation, and built on trust.<\\/span><\\/p><p><\\/p>\",\"vision_text_ar\":\"<p class=\\\"MsoNormal\\\" dir=\\\"rtl\\\"><span lang=\\\"ar-sa\\\" style=\\\"font-size:12pt;line-height:107%;font-family:\'Times New Roman\', serif;\\\" xml:lang=\\\"ar-sa\\\">\\u0623\\u0646 \\u0646\\u0643\\u0648\\u0646 \\u0627\\u0644\\u0648\\u062c\\u0647\\u0629 \\u0627\\u0644\\u0623\\u0648\\u0644\\u0649 \\u0641\\u064a \\u0627\\u0644\\u0645\\u0646\\u0637\\u0642\\u0629\\n\\u0644\\u0637\\u0644\\u0628 \\u0627\\u0644\\u062e\\u062f\\u0645\\u0627\\u062a \\u0627\\u0644\\u062a\\u0642\\u0646\\u064a\\u0629 \\u0648\\u0627\\u0644\\u0631\\u0642\\u0645\\u064a\\u0629 \\u0645\\u0646 \\u062e\\u0644\\u0627\\u0644 \\u0645\\u0646\\u0635\\u0629 \\u0645\\u0648\\u062b\\u0648\\u0642\\u0629 \\u062a\\u0639\\u062a\\u0645\\u062f \\u0639\\u0644\\u0649 \\u0627\\u0644\\u0630\\u0643\\u0627\\u0621 \\u0627\\u0644\\u0627\\u0635\\u0637\\u0646\\u0627\\u0639\\u064a\\n\\u0644\\u062a\\u0633\\u0647\\u064a\\u0644 \\u0627\\u0644\\u0637\\u0644\\u0628\\u060c \\u0648\\u062a\\u0633\\u0631\\u064a\\u0639 \\u0627\\u0644\\u0648\\u0635\\u0648\\u0644\\u060c \\u0648\\u0636\\u0645\\u0627\\u0646 \\u0627\\u0644\\u062c\\u0648\\u062f\\u0629<\\/span><span dir=\\\"ltr\\\"><\\/span><span dir=\\\"ltr\\\"><\\/span><span dir=\\\"ltr\\\" style=\\\"font-size:12pt;line-height:107%;font-family:\'Times New Roman\', serif;\\\"><span dir=\\\"ltr\\\"><\\/span><span dir=\\\"ltr\\\"><\\/span>.<\\/span><\\/p><p><\\/p>\",\"vision\":\"668f6561224731720673633.png\"}', NULL, '2024-05-27 09:22:42', '2025-07-05 07:48: