(160, 'Tina TothLE', 'Tina TothLE', 'alegriasocialmanagement@outlook.com', '87843491532', NULL, NULL, 'Hello, \r\nI hope you\'re well! I’m Tina, the founder of Alegria Social, a marketing agency specializing in organic social media growth based in Miami and Dubai. With over nine years of experience and a personal following of 1 million, I’m confident we can help your brand achieve its goals. \r\nI recently reviewed your Instagram profile and noticed great potential, but also some challenges in audience growth and engagement. That’s where we can assist! \r\nWe’ve helped over 250 brands boost sales, followers, and brand awareness, including clients who have collaborated with high-profile figures like Halle Berry. I’m confident we can bring similar success to your brand too. \r\nWe offer a range of Social Media Account Management packages, including: \r\n \r\n1. Instagram Account Management: 25 posts and 25-50 stories for $750/month. \r\n2. Multi-Account Management: Up to 3 accounts (Pinterest, Instagram, Facebook, TikTok, or Twitter) with 25 posts each for $1200/month. \r\nAll packages include the following services: \r\nContent Strategy: \r\n•  Content Calendar: Plan and schedule engaging posts in advance. \r\n•  Diverse Content: Use a mix of text, images, videos, and infographics. \r\n•  Hashtags: Incorporate relevant keywords for better discoverability. \r\nAnalytics: \r\n•  Monitoring: Analyze performance data to refine strategies. \r\n•  A/B Testing: Test different content types and posting times for optimal results. \r\nEngagement: \r\n•  Responses: Provide timely, personalized replies to comments and messages. \r\n•  Community Building: Encourage user-generated content and participate in conversations. \r\nBrand Voice and Identity: \r\n•  Consistency: Maintain a unified brand voice and visual identity. \r\n•  Authenticity: Foster trust through genuine communication. \r\nTrends and Innovations: \r\n•  Stay Updated: Monitor trends and adapt strategies accordingly. \r\n•  Adopt New Features: Embrace tools like Instagram Reels and TikTok trends. \r\nEnclosed is a media kit detailing our services, along with \'before\' and \'after\' results from our Social Media Management within one month. \r\n \r\nWould you be open to a quick Zoom call in the next few days? I’d love to discuss how we can help grow your brand. If you are interested, please email me at marketing@alegriasocial.com, so we can arrange the call. \r\nBest regards, \r\nTina Toth \r\nFounder, Alegria Social \r\nInstagram: @laelegantia', NULL, NULL, '2025-02-14 11:59:19', '2025-02-14 11:59:19'),
