INSERT INTO `opportunities` (`id`, `authority_id`, `title`, `title_ar`, `thumb`, `overview`, `overview_ar`, `created_at`, `updated_at`) VALUES
(68, 1, 'Investment projects to rehabilitate agricultural terraces in the southwestern regions of the Kingdom', 'مشاريع استثمارية لتأهيل المدرجات الزراعية في مناطق الجنوب الغربي من المملكة', '166531811686.webp', 'Investment projects to rehabilitate agricultural terraces in the southwestern regions of the Kingdom. Applying the latest rainwater harvesting techniques and making maximum use of it in irrigation works, and enhancing water reserves in dams. It also includes measuring the extent of water consumption from wells in the agricultural, industrial and commercial sectors, and making statistical studies and a database for use in the proper management of water resources.', 'مشاريع استثمارية لتأهيل المدرجات الزراعية في مناطق الجنوب الغربي من المملكة. وتطبيق أحدث تقنيات حصاد مياه الأمطار والاستفادة القصوى منها في أعمال الري، وتعزيز المخزون المائي في السدود.  كما يتضمن ذلك قياس مدى استهلاك مياه الآبار في القطاعات الزراعية والصناعية والتجارية، وعمل دراسات إحصائية وقاعدة بيانات للاستعانة بها في حسن إدارة الثروة المائية.', '2022-10-09 10:21:56', '2022-10-09 10:21:56'),
(69, 1, 'Establishing a specialized company for the development and management of agricultural products markets', 'إنشاء شركة متخصصة لتطوير وإدارة أسواق المنتجات الزراعية', '166531847141.jpg', 'Establishing a specialized company for the development and management of agricultural products markets such as vegetables, fruits, livestock and fish, and harnessing technology to establish an e-commerce specialized in marketing dates and their products locally and internationally, which raises the efficiency of agricultural consumption', 'إنشاء شركة متخصصة لتطوير وإدارة أسواق المنتجات الزراعية من خضار، وفواكه وماشية وأسماك، وتسخير التقنية لتأسيس تجارة إلكترونية متخصصة في تسويق التمور ومنتجاتها محليا ودوليا، مما يرفع كفاءة الاستهلاك الزراعي', '2022-10-09 10:27:51', '2022-10-09 10:27:51'),
(70, 1, 'Establishing and developing private fishing ports', 'إنشاء وتطوير مرافئ صيد خاصة في المناطق الساحلية', '166531856830.jpg', 'Establishing and developing private fishing ports in the eastern and western coastal areas of the Kingdom to serve, guide and assist fishermen. In addition to providing reliable bulletins on the state of the sea, wave height, wind speed and other matters of interest to fishermen.', 'إنشاء وتطوير مرافئ صيد خاصة في المناطق الساحلية الشرقية والغربية من المملكة لخدمة الصيادين وإرشادهم و مساعدتهم. إضافة الى إتاحة نشرات موثوقة عن حالة البحر وارتفاع الامواج وسرعة الرياح وغير ذلك مما يهم الصيادين.', '2022-10-09 10:29:28', '2022-10-09 10:29:28'),
(71, 6, 'Oilfield Equipment', 'معدات حقول النفط', '166533714971.jpg', 'Oilfield Equipment\r\nThis sector covers the localization opportunities for oilfield equipment and services within the Saudi Arabian energy market.', 'معدات حقول النفط\r\nيغطي هذا القطاع فرص توطين معدات وخدمات حقول النفط في سوق الطاقة السعودي.', '2022-10-09 15:39:09', '2022-10-09 15:39:09'),
(72, 6, 'Metal Ecosystem', 'النظام البيئي المعدني', '16653372325.jpg', 'Metal Ecosystem\r\nThis sector covers the localization opportunities for metal ecosystem related equipment within the Saudi Arabian energy market.', 'النظام البيئي المعدني\r\nيغطي هذا القطاع فرص توطين المعدات ذات الصلة بالنظام البيئي المعدني في سوق الطاقة السعودي.', '2022-10-09 15:40:32', '2022-10-09 15:40:32'),
(73, 6, 'Electrical Equipment', 'معدات كهربائية', '16653373315.jpg', 'Electrical Equipment\r\nThis sector covers the localization opportunities for electrical materials within the Saudi Arabian energy market.', 'معدات كهربائية\r\nيغطي هذا القطاع فرص توطين المواد الكهربائية في سوق الطاقة السعودي.', '2022-10-09 15:42:11', '2022-10-09 15:42:11'),
(74, 6, 'Fire Protection', 'الحماية من الحرائق', '16653373993.jpg', 'Fire Protection\r\nThis sector covers the localization opportunities for fire protection materials within the Saudi Arabian energy market.', 'الحماية من الحرائق\r\nيغطي هذا القطاع فرص توطين مواد الحماية من الحرائق في سوق الطاقة السعودي.', '2022-10-09 15:43:19', '2022-10-09 15:43:19'),
(75, 8, 'Establishment of global logistics platforms and zones and international aviation hubs', 'إنشاء منصات ومناطق لوجستية عالمية ومحاور دولية للطيران', '166533797479.jpg', 'Establishment of global logistics platforms and zones and international aviation hubs', 'إنشاء منصات ومناطق لوجستية عالمية ومحاور دولية للطيران', '2022-10-09 15:52:54', '2022-10-09 15:52:54'),
(76, 8, 'Developing port infrastructure', 'تطوير البنى التحتية للموانئ', '16653380486.jpg', 'Developing port infrastructure, expanding capacity, raising its operational efficiency, and enabling and investing capabilities to support sustainable development.', 'تطوير البنى التحتية للموانئ وتوسيع الطاقة الاستيعابية ورفع كفاءتها التشغيلية وتمكين واستثمار القدرات لدعم التنمية المستدامة.', '2022-10-09 15:54:08', '2022-10-09 15:54:08'),
(77, 8, 'تحسين تجربة المسافر', 'تحسين تجربة المسافر', '166533818128.jpg', 'Improving the passenger experience, providing greater and easier connectivity options with stations and cities around the world through low-cost domestic and regional flights, and improving the cost structure for sector operators, which contributes to competitive ticket prices.', 'تحسين تجربة المسافر وتوفير خيارات ربط أكبر وأسهل مع المحطات والمدن حول العالم عبر الطيران الاقتصادي محلياً وإقليمياً وتحسين هيكل التكلفة لمشغلي القطاع، ما يساهم بتنافسية أسعار التذاكر', '2022-10-09 15:56:21', '2022-10-09 15:57:28'),
(78, 9, 'Expanding the financing of the mining sector', 'التوسع في تمويل قطاع التعدين', '166533845553.jpg', 'Financing mining projects for all types of minerals with a financing rate of up to 75% of the project costs eligible for financing. Financing the final stage of exploration, which includes excavation and mining works. Supporting support services companies that contribute to raising the added value and sustainability of the mining sector in the Kingdom.', 'تمويل مشاريع التعدين لجميع أنواع المعادن وبنسبة تمويل تصل إلى 75% من تكاليف المشروع المؤهلة للتمويل. تمويل المرحلة النهائية من عمليات الاستكشاف التي تشمل أعمال الحفر وتجهيز المناجم. دعم شركات الخدمات المساندة والتي تساهم في رفع القيمة المضافة واستدامة القطاع التعديني في المملكة.', '2022-10-09 16:00:55', '2022-10-09 16:00:55'),
(79, 9, 'Energy Sector Financing', 'تمويل قطاع الطاقة', '166533855467.jpg', 'Financing the construction of sustainable industrial parks for renewable energy. Financing and developing local developers in the field of renewable energy production. Raising the quality of products specialized in solar and wind energy and aligning them with local and global demand. Financing renewable energy production projects for the industrial, commercial and agricultural sectors.', 'تمويل بناء مجمعات صناعية مستدامة للطاقة المتجددة. تمويل وتنمية المطورين المحليين في مجال إنتاج الطاقة المتجددة. رفع جودة المنتجات المختصة في الطاقة الشمسية وطاقة الرياح ومواءمتها مع الطلب المحلي والعالمي. تمويل مشاريع إنتاج الطاقة المتجددة للقطاع الصناعي والتجاري والزراعي.', '2022-10-09 16:02:34', '2022-10-09 16:02:34'),
(80, 9, 'Industry Financing', 'تمويل قطاع الصناعة', '166533866389.jpg', 'Financing industrial projects in promising regions and cities', 'تمويل المشاريع الصناعية في المناطق والمدن الواعدة', '2022-10-09 16:04:23', '2022-10-09 16:04:23'),
(81, 9, 'Financing the logistics sector', 'تمويل قطاع الخدمات اللوجستية', '166533875029.jpg', 'Supporting the logistics sector is one of the objectives of the Kingdom\'s Vision 2030 to transform the Kingdom into a global logistics center. To achieve this strategic goal, the Council of Ministers issued a decision to amend the Articles of Association of the Industrial Fund to enhance its role as a major financial enabler for the logistics sector by financing:', 'يمثل دعم قطاع الخدمات اللوجستية أحد مستهدفات رؤية المملكة 2030 لتحول المملكة إلى مركز لوجستي عالمي. ولتحقيق هذا الهدف الاستراتيجي، أصدر مجلس الوزراء قراراً بتعديل النظام الأساسي للصندوق الصناعي لتعزيز دوره كممكن مالي رئيس لقطاع الخدمات اللوجستية من خلال تمويل:', '2022-10-09 16:05:50', '2022-10-09 16:05:50'),
(82, 11, 'Vehicle rest houses, or similar services on federal roads', 'استراحات المركبات، أو أي خدمات مماثلة على الطرق الاتحادية', '16653389497.jpg', 'Vehicle rest houses, or similar services on federal roads', 'استراحات المركبات، أو أي خدمات مماثلة على الطرق الاتحادية', '2022-10-09 16:09:09', '2022-10-09 16:09:09'),
