(85, 11, 'Investing in partnership projects with the private sector in infrastructure, transport and housing', 'الاستثمار في مشاريع الشراكة مع القطاع الخاص في البنية التحتية والنقل والإسكان', '166533913455.jpg', 'Investing in partnership projects with the private sector in infrastructure, transport and housing', 'الاستثمار في مشاريع الشراكة مع القطاع الخاص في البنية التحتية والنقل والإسكان', '2022-10-09 16:12:14', '2022-10-09 16:12:14'),
(86, 12, 'operational investment opportunities', 'الفرص الاستثمارية التشغيلية', '166533927778.jpg', 'Means materials, equipment and spare parts that are secured to cover the company\'s need to implement its operational plans and scheduled maintenance plans, which are usually requested through annual purchases.', 'تعني المواد والمعدات وقطع الغيار التي يتم تأمينها لتغطية احتياج الشركة لتنفيذ خططها التشغيلية وخطط الصيانات المجدولة والتي عادة ما يتم طلبها من خلال المشتريات السنوية.', '2022-10-09 16:14:37', '2022-10-09 16:14:37'),
(87, 12, 'capital investment opportunities', 'الفرص الاستثمارية الرأسمالية', '166533934595.jpg', 'Means the materials and equipment that are secured for the implementation of the company\'s various projects (generation - transmission - distribution) and are secured through the company\'s annual contracts.', 'تعني المواد والمعدات التي يتم تأمينها لتنفيذ مشاريع الشركة المختلفة (توليد-نقل-توزيع) ويتم تأمينها من خلال عقود الشركة السنوية.', '2022-10-09 16:15:45', '2022-10-09 16:15:45'),
(88, 13, 'Industrial and mining information analysis, and foresight', 'تحليل المعلومات الصناعية والتعدينية، والاستشراف', '166533951823.jpg', '1) Establishment of an integrated and comprehensive industrial database (Industrial Observatory).\r\n\r\n2) Create an industrial and mining business intelligence and information platform.\r\n\r\n3) Geographical representation of industrial establishments data.\r\n\r\n4) Create a data studio module.\r\n\r\n5) Establishment of artificial intelligence services for industrial fields with 6 services', '1) إنشاء قاعدة بيانات صناعية متكاملة وشاملة (المرصد الصناعي).\r\n\r\n2) إنشاء منصة المعلومات وذكاء الأعمال الصناعية والتعدينية.\r\n\r\n3) تجسيد بيانات المنشآت الصناعية جغرافياً.\r\n\r\n4) إنشاء وحدة استوديو البيانات.\r\n\r\n5) إنشاء خدمات الذكاء الاصطناعي للمجالات الصناعية بعدد 6 خدمات', '2022-10-09 16:18:38', '2022-10-09 16:18:38'),
(89, 13, 'National construction cost competitiveness', 'القدرة التنافسية لتكلفة البناء الوطنية', '166533961137.jpg', 'Standards for building industrial facilities (building code for industrial facilities).\r\nStudy the current status of the cost of establishing new factories.', 'معايير بناء المنشآت الصناعية (كود بناء للمنشآت الصناعية).\r\nدراسة الوضع الحالي لتكلفة إنشاء المصانع الجديدة.', '2022-10-09 16:20:11', '2022-10-09 16:20:11'),
(90, 13, 'Industrial Capacity Development Center Initiative', 'مبادرة مركز تنمية القدرات الصناعي', '166533974649.jpg', '1. Create a digital platform.\r\n\r\n2. Qualification of human cadres.\r\n\r\n3. Industrial capacity development.\r\n\r\n4. Industrial Capacity Development Center.', '1.  انشاء منصة رقمية.\r\n\r\n2. تأهيل الكوادر البشرية.\r\n\r\n3. تنمية القدرات الصناعية.\r\n\r\n4. مركز تنمية القدرات الصناعية.', '2022-10-09 16:22:26', '2022-10-09 16:22:26'),
(91, 13, 'Digital Services Platform for the Investor\'s Industrial Journey', 'منصة الخدمات الرقمية لرحلة المستثمر الصناعية', '166533984148.jpg', 'Development and improvement of basic industrial services.\r\n  Development and improvement of industrial support services and integration mechanisms with agencies and factories\r\n  Development and improvement of investor journey services and linking with relevant authorities', 'التطوير والتحسين للخدمات الصناعية الأساسية.\r\n التطوير والتحسين لخدمات الدعم الصناعية وآليات التكامل مع الجهات والمصانع\r\n التطوير والتحسين لخدمات رحلة المستثمر والربط مع الجهات ذات العلاقة', '2022-10-09 16:24:01', '2022-10-09 16:24:01'),
(92, 27, 'technology projects', 'مشروعات التقنية', '166582006316.jpg', 'Feasibility study for the design of smart phone applications\r\n\r\nFeasibility of an e-marketing company\r\n\r\nFeasibility study of a phone factory\r\n\r\nFeasibility of a computer factory\r\n\r\nFeasibility study for VR devices.', '– دراسة جدوى تصميم تطبيقات الهواتف الذكية\r\n\r\n– جدوى شركة تسويق إلكتروني\r\n\r\n– دراسة جدوى مصنع هواتف\r\n\r\n– جدوى مصنع حواسيب آلية\r\n\r\n– دراسة جدوى أجهزة في أر.', '2022-10-15 05:47:43', '2022-10-15 05:47:43'),
(93, 27, 'Iron Factory Project', 'مشروع مصنع حديد', '166582018557.jpg', 'One of the important projects from which you can reap the amount of success or profits. What you want is the iron and steel project, and it is due to the high demand for the product that is offered through the project.\r\n\r\nIron is one of the most important materials that make up one of the basics of life. They are the facilities, so there are hundreds of agencies that need the element that is provided through the project.', 'من المشروعات الهامة التي تستطيع أن تحصد منها كمية النجاح أو الأرباح. التي تريدها هي مشروع الحديد والصلب، والأمر يرجع على كثرة الطلب على المنتج الذي يتم تقديمه من خلال المشروع.\r\n\r\nإن الحديد أحد أهم المواد التي تدخل في تكوين أحد أساسيات الحياة. وهي المنشآت، لذلك يوجد هناك المئات من الجهات التي تقوم بالاحتياج إلى العنصر الذي يتم تقديمه من خلال المشروع.', '2022-10-15 05:49:45', '2022-10-15 05:49:45'),
(94, 27, 'Guards company factory project', 'مشروع مصنع شركة حراسات', '166582030934.jpg', 'Service projects are of a special nature. As the services that are provided through service projects are usually in great demand. This is due to the fact that they need it periodically.\r\n\r\nRelying on guarding, whether in factories, orbit, palaces or villas, is one of the basic things, and this means that through this project you can achieve the success you desire.', 'إن المشروعات الخدمية ذات طابع خاص. حيث أن الخدمات التي يتم تقديمها من خلال المشروعات الخدمية عادة ما يكون عليها طلب كبير. وهذا الأمر يرجع بالفعل إلى احتياجها بشكل دوري.\r\n\r\nوالاعتماد على الحراسة سواء بالمصانع أو المدار أو القصور أو الفلل من الأمور الأساسية، وهذا يعني أنك من خلال هذا المشروع تستطيع أن تحقق النجاح الذي ترغب به.', '2022-10-15 05:51:49', '2022-10-15 05:51:49'),
(95, 28, 'Emirates Lab for Economic Growth Initiative', 'مبادرة مختبر الإمارات للنمو الاقتصادي', '166582284216.jpg', 'The laboratory was designed to be a leading institute for research and employment of data and economic models to make policies that enhance the future leadership of the UAE and the national economy in the areas of trade, investment, competition, small and medium enterprises and the Fourth Industrial Revolution.', 'وتم تصميم المختبر ليكون معهداً ريادياً للأبحاث وتوظيف البيانات والنماذج الاقتصادية لصنع السياسات التي تعزز الريادة المستقبلية لدولة الإمارات والاقتصاد الوطني في مجالات التجارة والاستثمار والمنافسة والمشاريع الصغيرة والمتوسطة والثورة الصناعية الرابعة.', '2022-10-15 06:07:29', '2022-10-15 06:34:02'),
(96, 28, 'SkillUp Academy', 'أكاديمية ريادة الأعمال', '166582143218.jpg', 'It aims to develop entrepreneurship skills and entrepreneurial thinking for citizens and residents in the UAE through educational initiatives and stimulating policies that provide a supportive environment for engaging in entrepreneurial activities and enhance the diversity and competitiveness of the national economy.', 'حيث تهدف إلى تطوير مهارات ريادة الأعمال والتفكير الريادي للمواطنين والمقيمين في الإمارات من خلال مبادرات تعليمية وسياسات تحفيزية توفر بيئة داعمة للالتحاق بأنشطة ريادة الأعمال وتعزيز تنوع وتنافسية الاقتصاد الوطني', '2022-10-15 06:10:32', '2022-10-15 06:10:32'),
(97, 28, 'Investopia', 'قمة \"Investopia\" للاستثمار', '166582150984.png', 'It aims to leave a mark on the agenda of major global investors and emulate the ambitious visions of leaders in business and investment fields in various sectors.', 'وتهدف إلى ترك بصمة على أجندة كبار المستثمرين العالميين وتحاكي الرؤى الطموحة لقادة مجالات الأعمال والاستثمار في مختلف القطاعات.', '2022-10-15 06:11:49', '2022-10-15 06:11:49'),
(98, 28, 'Grow in UAE', 'مبادرة ازدهر في الإمارات', '166582267598.jpg', 'It provides a smart portal for information about the investment climate and opportunities in the UAE, which provides potential investors with complete information about investment policies, procedures, studies, a map of the most attractive opportunities, market movement, and supportive services in the post-startup phase of the investment project. facilitating his investment journey and enhancing its success.', 'تقدم بوابة ذكية للمعلومات حول مناخ وفرص الاستثمار بدولة الإمارات، تتيح للمستثمرين المحتملين معلومات كاملة حول السياسات والإجراءات والدراسات الاستثمارية وخريطة الفرص الأكثر جذباً وحركة السوق وخدمات داعمة في مرحلة ما بعد البدء بالمشروع الاستثماري حيث توفر هذه البوابة مظلة للربط بين المستثمر الأجنبي والفرص المتنوعة في أسواق الدولة، وتسهيل رحلته الاستثمارية وتعزيز نجاحها.', '2022-10-15 06:13:03', '2022-10-15 06:31:15'),
(99, 29, 'Financial advisory service', 'خدمة الاستشارات المالية', '166582194412.jpg', 'The financial industry, especially the banking sector, is one of the most prosperous and profitable industries in Bahrain. If you have experience and training in finance, you may consider starting your own financial advisory service. You can choose to start a tax advisory service. Or if you have a large financial base you can consider setting up your own bank.', 'تعتبر الصناعة المالية وخاصة القطاع المصرفي من أكثر الصناعات ازدهارًا وربحًا في البحرين. إذا كانت لديك خبرة وتدريب في مجال التمويل، فيمكنك التفكير في بدء خدمة الاستشارات المالية الخاصة بك. يمكنك اختيار بدء خدمة استشارات ضريبية. أو إذا كان لديك قاعدة مالية كبيرة يمكنك التفكير في إنشاء بنك خاص بك.', '2022-10-15 06:19:04', '2022-10-15 06:19:04'),
(100, 29, 'building materials industry', 'صناعة مواد البناء', '166582203795.jpg', 'The building materials industry is already a growing and profitable industry in Bahrain. Any investor can enter this industry and make a fortune from this sector. Bahrain is famous for the production and export of building materials. So if you are interested in building materials industry in Bahrain, then you should consider starting your own construction company or getting into building materials manufacturing.', 'صناعة مواد البناء هي بالفعل صناعة متنامية ومربحة في البحرين. يمكن لأي مستثمر أن يدخل هذه الصناعة ويحقق ثروة من هذا القطاع. تشتهر البحرين بإنتاج وتصدير مواد البناء. لذلك إذا كنت مهتمًا بصناعة مواد البناء في البحرين، فعليك التفكير في إنشاء شركة إنشاءات خاصة بك أو الدخول في تصنيع مواد البناء.', '2022-10-15 06:20:37', '2022-10-15 06:20:37'),
(101, 29, 'Food import business', 'أعمال استيراد الأغذية', '166582217265.jpg', 'Because of Bahrain\'s poor agricultural land, the majority of Bahrain\'s food is imported. In fact, Bahrain imports the bulk of its meat from Australia. So if you are looking for a job to do in Bahrain, you should consider entering into a food import business. The demand for imported food is very high in Bahrain and it is indeed a profitable business to engage in.', 'بسبب فقر الأراضي الزراعية في البحرين، يتم استيراد غالبية المواد الغذائية في البحرين. في واقع الأمر، تستورد البحرين الجزء الأكبر من لحومها من أستراليا. لذلك إذا كنت تبحث عن عمل تقوم به في البحرين، فعليك التفكير في الدخول في مشروع استيراد المواد الغذائية. الطلب على المواد الغذائية المستوردة مرتفع للغاية في البحرين وهو بالفعل عمل مربح للانخراط فيه.', '2022-10-15 06:22:52', '2022-10-15 06:22:52'),
(102, 29, 'Hospital and health services', 'خدمات المستشفيات والخدمات الصحية', '166582225517.jpg', 'If you are a trained doctor, you may consider setting up your own hospital. The truth is that Bahrain is open to doctors from all over the world especially from African countries like Nigeria and others. Although setting up a hospital requires a lot of capital, the fact remains that it is a very profitable business in Bahrain.', 'إذا كنت طبيباً مدرباً، فيمكنك التفكير في إنشاء المستشفى الخاص بك. الحقيقة هي أن البحرين مفتوحة للأطباء من جميع أنحاء العالم وخاصة من الدول الأفريقية مثل نيجيريا وغيرها. على الرغم من أن إنشاء مستشفى يتطلب الكثير من رأس المال، إلا أن الحقيقة تبقى أنه من الأعمال المربحة للغاية في البحرين.', '2022-10-15 06:24:15', '2022-10-15 06:24:15'),
(103, 30, 'Argentine companies exporting quality canned food', 'الشركات الأرجنتينية المصدرة للأغذية المعلبة ذات الجودة', '166582375965.jpg', 'Field Argentine companies exporting quality canned food Entity National Institute of Industrial Technology Ministry of Economy of the Argentine Republic', 'المجال الشركات الأرجنتينية المصدرة للأغذية المعلبة ذات الجودة الجهة المعهد الوطني للتكنولوجيا الصناعية وزارة الاقتصاد بجمهورية الأرجنتين', '2022-10-15 06:49:19', '2022-10-15 06:49:19'),
(104, 30, 'TM Pripravka', 'بهارات نقية وطبيعية', '166582384820.jpg', 'TM Pripravka is the first brand in Ukraine that began to produce natural seasonings without glutamate, taste enhancers, flavors, coloring and preserving agents', 'TM Pripravka هي العلامة التجارية الأولى في أوكرانيا التي بدأت في إنتاج توابل طبيعية بدون الغلوتامات ومحسنات الطعم والنكهات والتلوين وعوامل الحفظ', '2022-10-15 06:50:48', '2022-10-15 06:50:48'),
(105, 30, 'Development of the China-Pakistan Economic Corridor', 'تطوير الممر الاقتصادي بين الصين وبكستان', '166582403215.jpg', 'Development of the China-Pakistan Economic Corridor', 'تطوير الممر الاقتصادي بين الصين وبكستان', '2022-10-15 06:53:52', '2022-10-15 06:53:52'),
(106, 30, 'The national card for Algerian products', 'البطاقة الوطنية للمنتوجات الجزائرية', '166582471451.jpg', 'The national card for Algerian products is the authority of the Algerian Ministry of Trade', 'البطاقة الوطنية للمنتوجات الجزائرية الجهة وزارة التجارة الجزائرية', '2022-10-15 07:05:14', '2022-10-15 07:05:14'),
(107, 31, 'Lebanese University Hospital', 'مستشفى الجامعة اللبناني', '168164034027.png', 'The Lebanese University Hospital, an investment project in the health sector in Iraq, which will add to the available hospital bed capacity and create new job opportunities.', 'مستشفى الجامعة اللبناني، وهو مشروع استثماري في قطاع الصحة في العراق، والذي سيضيف الى سعة أسرّة المستشفيات المتوفرة، ويخلق فرص عمل جديدة', '2023-04-16 08:19:00', '2023-04-16 08:19:00'),
(108, 31, 'Sinbad Land entertainment city', 'مدينة السندباد لاند الترفيهية', '168164057869.png', 'Sinbad Land is an entertainment and commercial project in Baghdad. The project provides various games in addition to shops, and has succeeded in providing hundreds of jobs for Iraqis in the fields of information technology, engineering, maintenance and other fields.', 'سندباد لاند هو مشروع ترفيهي وتجاري في بغداد. يوفر المشروع العاب مختلفة بالإضافة الى محلات تجارية، ونجح في توفير مئات الوظائف للعراقيين في مجالات تكنولوجيا المعلومات والهندسة والصيانة وغيرها من المجالات', '2023-04-16 08:22:58', '2023-04-16 08:22:58'),
(109, 31, 'Kala dairy factory in Karbala', 'مصنع البان كالا في كربلاء', '168164071423.png', 'It works to fill the need of the Iraqi market, not only for dairy, but also for other products such as juices, ice cream, and meat, in addition to providing job opportunities for the Iraqi workforce, including workers, engineers, and technicians.', 'يعمل على سد حاجة السوق العراقية ليس فقط من الالبان وانما من منتجات أخرى كالعصائر والمثلجات واللحوم، بالإضافة الى توفير فرص عمل للايدي العاملة العراقية من عمال ومهندسين وتقنيين.', '2023-04-16 08:25:14', '2023-04-16 08:25:14'),
(110, 31, 'New Kadhimiya City Project in Baghdad', 'مشروع مدينة الكاظمية الجديدة في بغداد', '168164083657.png', 'The Iraqi government is working to solve the housing crisis by providing support for housing investment projects.\r\nWatch this short video about the new Kadhimiya city project in Baghdad, which includes service, health and entertainment facilities.', 'تعمل الحكومة العراقية على حل ازمة السكن من خلال توفير الدعم للمشاريع الاستثمارية السكنية.\r\nشاهد هذا الفيديو القصير عن مشروع مدينة الكاظمية الجديدة في بغداد الذي يحتوي مرافق خدمية وصحية وترفيهية.', '2023-04-16 08:27:16', '2023-04-16 08:27:16'),
(111, 32, 'Establishing photovoltaic panels stations to produce electricity in Fares', 'نشاء محطات ألواح ضوئية لإنتاج الكهرباء بمنطقة فارس', '168164104990.jpg', '​\r\n\r\n​\r\n\r\n​\r\n\r\nEstablishing photovoltaic panels stations to produce electricity in Fares 1.\r\nRegulatory rules for licensing usufruct of lands necessary for the establishment of electric power production projects from renewable energy sources\r\n\r\nIssued by Cabinet Resolution No. (37/4/15/14) on 4/1/2015\r\n\r\nUsufruct right 20 years', '​\r\n\r\n​\r\n\r\n​\r\n\r\nانشاء محطات ألواح ضوئية لإنتاج الكهرباء بمنطقة فارس1.\r\nالقواعد التنظيمية للترخيص بالانتفاع بالاراضي اللازمة لإقامة مشروعات إنتاج الطاقة الكهربائية من مصادر الطاقة المتجددة\r\n\r\nالصادر بقرار مجلس الوزراء رقم(37/4/15/14) بتاريخ 1/4/2015\r\n\r\nحق الانتفاع 20 سنه ​', '2023-04-16 08:30:49', '2023-04-16 08:30:49'),
(112, 32, 'Management and operation of (3) cafeterias, (4) bazaars, gift house (Greek-Roman Museum)', 'إدارة وتشغيل عدد (3) كافتيريات، عدد (4) بازارات، بيت هدايا (المتحف اليوناني روماني)', '168164789610.jpg', 'Cafeteria space:\r\n\r\nCafeteria No. (1): with an area of 12.30 x 16.5 x m, with three rooms branching from it:\r\nThe first room: (7.90 x 450 m)\r\n  The second room: (7.90 x 3.36 m).\r\nThe third room: (17 x 5.50 m).\r\nCafeteria No. (2): with an area of 12.70m x 13.45m, attached to a kitchen (6.90 x 5m), a men\'s bathroom unit + a women\'s bathroom unit.\r\n\r\nCafeteria No. (3): with an area of 24.50m x 13.22m, attached to a kitchen and equipment, to be a restaurant, where the kitchen contains hoods and a ventilation system for fumes resulting from cooking.\r\n\r\nBazaar Area:\r\n\r\nBazaar No. 1: with an area of (3.50m x 2.30m).\r\nBazaar No. 2: with an area of (3.50m x 2.36m).\r\nBazaar No. 3: with an area of (5.16m x 2.59m).\r\nBazaar No. 4: with an area of (6m x 2.60m).\r\n\r\nGift House: with an area of (4.3m x 5.9m).', 'مساحة الكافيتريات:\r\n\r\nالكافتريا رقم (1): بمساحة 12.30× 16,5×م  ، متفرع منها ثلاث غرف: \r\nالغرفة الأولى: (7,90 x 450م)\r\n الغرفة الثانية: (7.90× 3.36م). \r\nالغرفة الثالثة: (17× 5.50م).\r\nالكافتريا  رقم (2): بمساحة 12.70م× 13.45م ، ملحق بها مطبخ (6.90×5م)، وحدة حمام رجال + وحدة حمام سيدات.\r\n\r\nالكافتريا رقم (3): بمساحة 24.50م× 13.22م، ملحق بها مطبخ  وتجهيزات على أن تكون مطعم حيث يحتوى المطبخ على شفاطات ونظام تهوية للأبخرة الناتجة عن الطبخ.\r\n\r\nمساحة البازارات:\r\n\r\nبازار  رقم١: بمساحة (3.50م×2.30م).\r\nبازار رقم2: بمساحة (3.50م×2.36م).\r\nبازار رقم 3: بمساحة (5.16م×2.59م).\r\nبازار رقم4: بمساحة (6م×2.60م).\r\n\r\nبيت الهدايا: بمساحة (4.3م x 5.9م).', '2023-04-16 10:24:56', '2023-04-16 10:24:56'),
(113, 32, 'Establishing a dry port in Burj Al Arab on an area of 90 acres', 'إنشاء ميناء جاف بمدينة برج العرب على مساحة 90 فدان', '168164806144.jpg', 'The aim of the project:\r\nCompletion and linking of multimodal transport links.\r\nRealization of logistics concepts to reduce transportation costs.\r\nPreventing congestion in seaports.\r\nSupport the national economy.\r\nServing the industrial zone in Burj Al Arab and New Alamein City.\r\nFacilitate the movement of exports and imports to the region.\r\nPreventing congestion in the ports of Alexandria and Dekheila.\r\nThe utilities are being delivered to the borders of the project, at a cost of 99 million pounds. The plan is to deliver the utilities on 12/31/2022.\r\ncomments:\r\nCoordination is underway with the European Bank for Reconstruction and Development to allocate a grant to prepare the necessary studies for the project\r\nComponents of the project:\r\nEstablishment of a dry port on an area of 90 acres.\r\nEstimated cost: $100 million, equivalent to EGP 1.6 billion (construction cost)\r\nFunding Source: Partnership with the private sector', 'الهدف من المشروع:\r\nاستكمال وربط حلقات النقل المتعدد الوسائط .\r\nتحقيق مفاهيم اللوجستيات لتقليل تكاليف النقل.\r\nمنع التكدس بالموانئ البحري.\r\nدعم الاقتصاد القومي .\r\nخدمة المنطقة الصناعية بمدينة برج العرب ومدينة العالمين الجديدة.\r\nتيسير حركة الصادرات والواردات للمنطقة.\r\nمنع التكدس بمينائي الإسكندرية والدخيلة.\r\nجاري توصيل المرافق حتى حدود المشروع بتكلفة 99مليون جنيه ، مخطط نهو توصيل المرافق  2022/12/31.\r\nملاحظات:\r\nجاري التنسيق مع البنك الاوروبي لإعادة الاعمار والتنمية لتخصيص منحة لإعداد الدراسات اللازمة للمشروع.​\r\nمكونات المشروع:\r\nانشاء ميناء جاف على مساحة 90 فدان. \r\nالتكلفة التقديرية:100مليون دولارما يعادل 1.6 مليار جنيه( تكلفة إنشاء )  \r\nمصدر التمويل:الشراكة مع القطاع الخاص', '2023-04-16 10:27:41', '2023-04-16 10:27:41');
