(3089, 181, NULL, 198, NULL, 'مرحبًا،\r\nأرغب بالاستفادة من خدمتك لتصميم واجهة المستخدم وتجربة المستخدم (UI/UX) وتكوين الأفكار لتطبيق علاجي ذكي باسم CoreCare.\r\n\r\n💡 فكرة المشروع باختصار:\r\n\r\nCoreCare هو تطبيق للعلاج الوظيفي يدعم حسابين (مريض – أخصائي علاج وظيفي).\r\nيُتيح للمريض متابعة تمارين علاجية يومية على شكل فيديوهات، تسجيل تقييم الألم، وحفظ التقدّم. كما يقوم التطبيق بإرسال تنبيهات للمريض لتذكيره بأداء التمارين يوميًا، مما يعزز الالتزام.\r\nويُتيح للأخصائي متابعة تقارير كل مريض، تخصيص تمارين، ومتابعة الأداء عبر لوحة تحكم.\r\nالهدف الأساسي هو تحسين التزام المريض بالخطة العلاجية وزيادة فعالية جلسات التأهيل.\r\n\r\n⸻\r\n\r\n🎯 احتياجات التصميم:\r\n	•	تصميم واجهات UI للمريض والأخصائي (دخول، لوحة تحكم، تمارين، تقارير، دردشة…)\r\n	•	تجربة مستخدم UX تسهّل استخدام التطبيق وتشجع على الالتزام اليومي\r\n	رحلة المستخدم (User Journey) لكل دور (مريض/أخصائي)\r\n	اقتراح أفكار تحفيزية لرفع التفاعل مثل النقاط والمكافآت\r\n	هوية بصرية بسيطة وعصرية تتماشى مع المجال الصحي والتأهيلي\r\n	دعم اللغتين العربية والإنجليزية\r\n	واجهات مرنة تصلح لتطبيق على Android وiOS\r\n\r\n\r\n\r\n التوسعة المستقبلية:\r\n\r\nنخطط لتطوير CoreCare ليصبح منصة شاملة لخدمات التأهيل المختلفة، تشمل العلاج الطبيعي، التأهيل النفسي، علاج النطق، والتأهيل العصبي، مع تخصيص أدوات وتقارير لكل تخصص، ودعم العمل الجماعي بين الأخصائيين لتعزيز رعاية شاملة للمريض.\r\n\r\nهل يمكنك تنفيذ ذلك؟\r\nأتطلع لرؤية سابقة أعمالك وتفاصيل العرض (مدة – تكلفة – مراحل العمل).\r\nشاكر لك اهتمامك، ومستعد لتقديم أي تفاصيل إضافية.\r\n\r\nتحياتي،\r\nنصار البلادي', NULL, 'نصار بريك مبيريك البلادي', '0538287968', 'nassar-al-baladi@hotmail.com', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'صاحب فكرة مشروع corecare', 'نشاط الشركة: تطوير حلول رقمية مبتكرة في مجال التأهيل والعلاج الوظيفي باستخدام الذكاء الاصطناعي وتقنيات الواقع الافتراضي لتحسين التزام المرضى وجودة الرعاي', NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, '2025-06-20 19:57:35', '2025-07-10 12:59:52'),
